        [
            {
                "number": 2,
                "text": "Istanbul (CNN) -- An earthquake that rattled western Turkey killed at least two people and injured dozens more, hospital and government officials said on Friday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
