            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Turkey's Kandilli Earthquake Observatory said the epicenter was the town of Simav in Kutahya province, where aftershocks rippled across the region overnight",
