            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Emergency officials swiftly responded with search and medical crews, and supplies such as blankets, water and food",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The Kutahya region recently had a scare of leaked cyanide-contaminated water from a wastewater dam after an embankment collapse",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Crews are checking to see whether the dam was damaged by the quake and so far, there is \"no risk,\" said Veysel Eroglu, the environment minister",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

