                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Sarah Thacker, a Minnesota woman who was in Haiti to bring home her newly adopted son, now finds herself facing allegations that the paperwork she held was forged",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Thacker and two other women who helped her were not arrested, but are the subject of the incident that follows the arrests of 10 U.S. missionaries accused of taking a group of Haitian children out of the country without the proper paperwork",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "All 10 were charged with trying to take 33 children out of Haiti without any legal authorization after a magnitude-7.0 earthquake devastated the country on January 12",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Eight of them have been released on bail and have returned to the United States",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Thacker and the two other women were going to escort six Haitian orphans to the United States to new families, including Thacker's adopted son, Reese",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "\"I can understand paranoia and absolutely, and I understand there was a story about people illegally taking children out of the country, but fear doesn't justify these actions,\" Stephanie Anderson, a volunteer who was helping Thacker, told CNN",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "On Saturday, the three women were outside the Port-au-Prince airport waiting in line to transport the children in a private plane when, Anderson says, they were surrounded by an angry mob of men demanding to see their paperwork",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "\"They started screaming at us that they are Haitian children, and who do we think we are taking their kids from their country, and these missionaries can't be stealing kids, and they started swearing and yelling at us,\" Anderson, who is not a missionary, said",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The police were called in and the women were detained for eight hours, they told CNN",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

