{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Kathmandu, Nepal (CNN)Rescue crews and residents in Nepal early Sunday began the desperate search for survivors after a magnitude-7.8 quake near the capital of Kathmandu a day earlier flattened homes, buildings and temples, causing widespread damage across the region and killing more than 1,800 people",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Follow the latest coverage of Nepal earthquake\n\nWhole streets and squares in the capital of more than 1 million people were covered in rubble",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Stunned residents stared at temples that were once part of their daily lives and now were reduced to nothing",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Locals and tourists ferreted through mounds of debris in search of survivors",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Cheers rose from the piles when people were found alive -- but mostly bodies turned up",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The injured ended up being treated outside overflowing hospitals, where crowds of people gathered looking for relatives",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Dozens of bodies were pulled from the historic nine-story Dharahara tower that came crashing down during the quake",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "At least 17 people were reported killed on Mount Everest, where the quake caused multiple avalanches",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "A seemingly endless series of aftershocks continued to roil the area, further traumatizing survivors",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Residents huddled in the cold rain overnight for safety",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The death toll of 1,832 is expected to rise as the full extent of the damage is assessed",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

