{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Japan's cabinet on Friday approved a $49 billion budget to help in the reconstruction of areas decimated by last month's earthquake and tsunami",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The Disaster Relief Fund will pay for removal of rubble and debris, temporary housing, rebuilding of roads, farms, airports and schools, and loans to small- and medium-sized businesses",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Seeking to turn the nation's focus to the arduous task of rebuilding, Japanese Prime Minister Naoto Kan last week invoked the imagery of his country's recovery from World War II",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"We must renew the determination that we had in the post-World War II reconstruction period, and we must tackle the task of reconstruction after this earthquake,\" he said",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The devastation left behind by the March 11 earthquake is an opportunity to build \"a new, better future than before,\" said the prime minister, who was born in 1946 -- a year after the end of the war",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Kan said the Japanese people \"stood up bravely and achieved a reconstruction that amazed the world.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The fund is only expected to cover a fraction of the total cost of recovery",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The double disaster could cost Japan's government in excess of $305 billion, Deputy Finance Minister Mitsuru Sakurai told reporters last month",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The monster 9.0-magnitude quake that rocked the country also spawned a tsunami, leaving nearly 28,000 people dead or missing",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "CNN's Steven Jiang contributed to this report",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

