{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Japan's cabinet on Friday approved a $49 billion budget to help in the reconstruction of areas decimated by last month's earthquake and tsunami",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The Disaster Relief Fund will pay for removal of rubble and debris, temporary housing, rebuilding of roads, farms, airports and schools, and loans to small- and medium-sized businesses",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Seeking to turn the nation's focus to the arduous task of rebuilding, Japanese Prime Minister Naoto Kan last week invoked the imagery of his country's recovery from World War II",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"We must renew the determination that we had in the post-World War II reconstruction period, and we must tackle the task of reconstruction after this earthquake,\" he said",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The devastation left behind by the March 11 earthquake is an opportunity to build \"a new, better future than before,\" said the prime minister, who was born in 1946 -- a year after the end of the war",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Kan said the Japanese people \"stood up bravely and achieved a reconstruction that amazed the world.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The fund is only expected to cover a fraction of the total cost of recovery",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The double disaster could cost Japan's government in excess of $305 billion, Deputy Finance Minister Mitsuru Sakurai told reporters last month",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The monster 9.0-magnitude quake that rocked the country also spawned a tsunami, leaving nearly 28,000 people dead or missing",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "CNN's Steven Jiang contributed to this report",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Port-au-Prince, Haiti (CNN) -- In patches across the Haitian capital, many earthquake survivors are not waiting for an international clearing and rebuilding effort to begin",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "They are pulling out shovels, wood and cement to slowly repair and rebuild themselves",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "\"This is what we have to do now,\" Jean-Fritznel St. Claire said as he hammered away at huge, fallen slabs of a Digicel office building, breaking them into chunks to be shoveled into a truck and taken away",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Digicel is a telecommunications company",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "St. Claire and three friends working with him at Digicel expected the company to pay them for their hard labor, but the group insists that they and others who stayed in the earthquake zone are eager to start clearing rubble and building what they can",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"The people who left [Port-au-Prince] have no hope,\" he said, his face dripping with sweat",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"We have hope",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "So we're here.",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Elsewhere in Port-au-Prince, businesses and families repaired cinderblock walls and pounded new beams into fractured roofs",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "One work crew near the airport replaced several broken sewer pipes that were part of a system set up for their neighborhood",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "But this individual rebuilding alarms teams of engineers studying the damage in Haiti after the 7.0-magnitude earthquake January 12",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

