{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- In the heart of Northern California's wine country, piles of stemware lay shattered on the ground",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Building facades in historic downtown Napa crumbled into the streets",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "And residents who enjoyed decades of calm received a harsh reminder that intense quakes can strike anytime",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"I was in shock to see people's homes and offices on the floor,\" Napa resident Elise Martinez said",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"This is life-changing.",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "But even as the Bay Area tries to clean up from its strongest earthquake in 25 years, the tremor could have been much worse",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "No one was killed in the 6.0-magnitude earthquake that jostled residents awake early Sunday",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The Queen of the Valley Medical Center said it has treated \"approximately 208\" patients since the earthquake struck",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Of those, 17 were admitted to the hospital, and one is still in critical condition",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The majority of patients sustained injuries that were not life-threatening",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "But the hospital has not seen any patients related to the earthquake since 11 p.m. PT Sunday",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

