{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- In the heart of Northern California's wine country, piles of stemware lay shattered on the ground",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Building facades in historic downtown Napa crumbled into the streets",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "And residents who enjoyed decades of calm received a harsh reminder that intense quakes can strike anytime",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"I was in shock to see people's homes and offices on the floor,\" Napa resident Elise Martinez said",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"This is life-changing.",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "But even as the Bay Area tries to clean up from its strongest earthquake in 25 years, the tremor could have been much worse",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "No one was killed in the 6.0-magnitude earthquake that jostled residents awake early Sunday",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The Queen of the Valley Medical Center said it has treated \"approximately 208\" patients since the earthquake struck",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Of those, 17 were admitted to the hospital, and one is still in critical condition",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The majority of patients sustained injuries that were not life-threatening",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "But the hospital has not seen any patients related to the earthquake since 11 p.m. PT Sunday",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Miami, Florida (CNN) -- The parents of an injured baby girl who was flown to Florida for treatment after Haiti's earthquake have been told what they already know: They are the biological parents of the little girl",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The International Red Cross notified Nadine Devilme and Junior Alexis in Haiti that DNA testing proves that the infant is theirs, said Mark LaPoint, an attorney representing the baby",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Rescuers dubbed her Patricia, but her parents call her Jenny",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "On Wednesday morning, Miami-Dade Circuit Judge Cindy Lederman decided that Jenny's parents will get to take her back to Haiti after doctors and nurses in Florida finish treating her",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"This is a case where these were really good parents, and I can't wait for these parents to be reunited with their baby,\" the judge said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"This is one happy day.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Federal authorities have pledged to help Devilme and Alexis travel from Haiti to the United States to reunite with their daughter, though the timing of that trip has not yet been determined, said Bob Martinez, an attorney for the parents",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The baby still has a hard time closing her left hand and needs some medical therapy, LaPoint said in court Wednesday",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The judge scheduled a hearing for April 7 to get an update on the baby's condition",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Jenny was 4 months old when the January 12 earthquake destroyed large swaths of Haiti",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Her mother was knocked unconscious in the 7.0-magnitude temblor and taken to a hospital",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

