{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Hong Kong (CNN) -- A strong earthquake struck the southwestern Chinese province of Sichuan on Saturday, killing at least 179 people and injuring about 6,700 others in a region that suffered a catastrophic quake five years ago, the state-run Xinhua news agency reported Sunday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Thousands of emergency workers, including soldiers, rushed to reach the affected zones in the hilly region, and Chinese Premier Li Keqiang traveled to the area from Beijing, state media reported",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Xu Mengjia, the Communist Party chief of Ya'an, the city that administers the area where the quake struck, told state broadcaster CCTV that because of landslides and disruption to communications, determining the total number of casualties may take some time",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Students gather outside to escape the quake\n\nThe quake struck just after 8 a.m. local time Saturday, about 115 kilometers (70 miles) away from the provincial capital, Chengdu, at a depth of around 12 kilometers, according to the U.S. Geological Survey",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "There was conflicting information about the earthquake's strength, with the USGS putting the magnitude at 6.6 and the China Earthquake Networks Center gauging it at 7.0",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "It was followed by a series of aftershocks, some of them as strong as magnitude 5.1, the USGS said",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Authorities have responded by sending rescue workers to the area around the epicenter, briefly halting flights at the airport in Chengdu and suspending high-speed rail operations, state media reported",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
