{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Rescuers in Iran worked furiously Tuesday to free people trapped under rubble, a day after a powerful earthquake rippled through a rural stretch of villages in the country's southeastern region, Iranian media reported",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Iran's Press TV said aftershocks followed the 6.5 magnitude Monday quake that struck at least 70 villages in Kerman province",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Iranian authorities recorded seven deaths and dozens of injuries so far, but authorities expect the casualty toll to rise in the quake -- just over 60 miles away from the site of a deadly tremor that killed 30,000 people seven years ago in the city of Bam",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Iran's Islamic Republic News Agency reported that scores of people are trapped in the debris of buildings that have been destroyed",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Many such sites are in hard-to-reach locations, making any rescue operations even more difficult",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Are you there",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "?",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Share earthquake stories with CNN iReport\n\nJessica Sigala, a U.S. Geological Survey physicist in Golden, Colorado, thinks the number of deaths could range from between 10 to 1,000, based on statistics and information about past earthquakes",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "She said that while this latest event was similar in magnitude to the Bam quake, which measured at 6.6 magnitude, the Monday quake struck a more remote region about 63 miles away from that city",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\"That's an important thing to realize",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "That distance will help decrease the fatality rate as well as the damage,\" she said",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "\"There isn't a big city anywhere to be seen.",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": "\"",
                "label": "no-unit"
            }
        ]
    ]
}

