{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Two days after a massive fertilizer plant explosion leveled parts of a central Texas town, killing 14 people and displacing many more, residents moved into recovery mode Friday after investigators announced they had nearly finished search and rescue efforts",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The fiery explosion ripped through the heart of West, a close-knit town about 75 miles south of Dallas and about 20 miles north of Waco",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Before Wednesday, West was known as the home of Scott Podsednik of the Boston Red Sox and as the \"Czech heritage capital of Texas,\" boasting the best kolache in the state",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"It's going to be a long recovery for this community,\" Gov",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Rick Perry said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The death toll included the city secretary, who was also a member of the volunteer fire department, said Mayor Tommy Muska",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The victim was the only person with the password to the city's Facebook account, Muska said, preventing others from posting updates about the incident",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "In total, five West firefighters died battling the blaze, along with one Dallas firefighter and four emergency responders, the State Firemen's and Fire Marshals' Association of Texas said Thursday",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\"It's devastating",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "I've been a member of the firefighters for 26 years,\" Muska said",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "\"These guys are my friends.",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": "\"",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- There have been no reports of major damage or injuries in the wake of a magnitude 6.8 earthquake in Chile, according to the country's leader",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "President Sebasti\u00e1n Pi\u00f1era told TV Chile that the quake was felt from Valpara\u00edso, north of Santiago, to the lake region in the south",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "He also said it was probably an aftershock of a massive and deadly temblor that rocked the region in February 2010",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Pi\u00f1era arrived in Santiago to assess the situation a little over an hour after Friday's earthquake occurred",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "It struck in the early afternoon off the coast of central Chile, according to the U.S. Geological Survey, with the Earth rupturing at a depth of 17.4 miles (28 kilometers) under the sea off the Biob\u00edo region",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The epicenter was 30 miles (45 kilometers) north of Concepci\u00f3n, the regional capital and the second-largest city in Chile",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Hundreds died there after a magnitude 8.8 earthquake rocked the city February 27, 2010",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Residents of coastal towns near Concepci\u00f3n self-evacuated, according to an Interior Ministry official",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\"This was done as a precaution,\" Rodrigo Ubilla told TV Chile",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "\"We are calm and assured that there was no major damage.",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Images from Concepci\u00f3n showed hundreds of people crying in the streets after fleeing office buildings and high-rise apartments",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

