{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Tokyo (CNN) -- Even as Washington and Tokyo disagreed on the extent of the threat a damaged nuclear power plant poses, President Barack Obama told the Japanese prime minister Thursday that the United States will help Japan rebuild following last week's devastating earthquake and tsunami",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The two leaders had a 30-minute phone call at 10:30 a.m. Thursday (9:30 p.m",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "ET Wednesday)",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "During the phone call with Prime Minister Naoto Kan, Obama voiced sympathy for Japan's plight",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"The president again conveyed his deep condolences at the tragic loss of life and the widespread suffering in northeastern Japan,\" a White House statement on the call said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"The president emphasized that the U.S. is determined to do everything possible to support Japan in overcoming the effects of the devastating earthquake and tsunami that struck on March 11.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Kan also briefed the president on the status of Japanese efforts to contain the nuclear emergency at the Fukushima Daiichi plant in the country's northeast, the White House said",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The developments came as the nations established significantly different radiation exposure warning zones",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
