{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "CHENGDU, China (CNN) -- Rainy weather and poor logistics thwarted efforts by relief troops who walked for hours over rock, debris and mud on Tuesday in hopes of reaching the worst-hit area of an earthquake that killed nearly 10,000 in central China, state-run media reported",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Setting out from Maerkang in Sichuan Province at 8 p.m. Monday, the 100 or so troops had to travel 200 kilometers (124 miles) to go before reaching Wenchuan, the epicenter of the quake, also in the province, Xinhua reported",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "After seven hours, they still had 70 kilometers (43 miles) to go",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"I have seen many collapsed civilian houses, and the rocks dropped from mountains on the roadside are everywhere,\" the head of the unit, Li Zaiyuan, told Xinhua",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Added CNN Correspondent John Vause: \"The roads here are terrible in the best of times ... right now they're down right atrocious",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "They've resorted to going in one man at a time on foot.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Nearly all the confirmed deaths were in Sichuan Province, but rescuers were hindered because roads linking it to the provincial capital, Chengdu, were damaged, Xinhua reported",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Local radio quoted disaster relief officials as saying a third of the buildings in Wenchuan collapsed from the quake and another third were seriously damaged",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The earthquake was powerful enough to be felt throughout most of China",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Many children were buried under the rubble of their schools",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The Chinese government said the death toll was sure to rise",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

