                "text": "\"An additional nuclear test or two would greatly increase the likelihood that Pyongyang could fashion warheads to fit at least some of its missiles -- a circumstance that would vastly increase the threat its nuclear program poses to the security of Northeast Asia,\" wrote analyst Frank Pabian and Siegfried Hecker, a Stanford University professor who visited North Korean nuclear sites in 2010",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Hong Kong (CNN) -- When North Korea conducts an underground nuclear test, a vast array of global sensors will detect the detonation almost immediately",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "But key questions about the size of the explosion, the number of bombs tested, or whether plutonium or uranium was used, may never be answered conclusively, analysts say",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "North Korea appears to have conducted an underground nuclear bomb test Tuesday, as the U.S. Geological Survey reported a seismic disturbance centered near the site of the secretive regime's two previous nuclear tests",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The area around the reported epicenter of the magnitude 4.9 disturbance has little or no history of earthquakes or natural seismic hazards, according to U.S. Geological Survey maps",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Despite international condemnation, North Korea has said it would conduct its third underground nuclear test",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "A third nuclear test could enable North Korea the technical data needed to miniaturize a warhead, according to a recent paper in the \"Bulletin of the Atomic Scientists.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Coming on the heels of December's successful launch of a satellite, the threat of an atomic test has raised concerns",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Pyongyang's efforts seemed hapless when a rocket launch failed earlier in 2012",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "But its spotty record changed in early December when North Korea launched the long-range Unha-3 rocket carrying a satellite, showing the world it had the technology to launch a long-range missile -- with analysts suggesting parts of the United States, Pyongyang's stated arch rival, were now within range",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Following the U.N. condemnation of the launch in January, Pyongyang says it plans a new nuclear test and further long-range rocket launches",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "\"An additional nuclear test or two would greatly increase the likelihood that Pyongyang could fashion warheads to fit at least some of its missiles -- a circumstance that would vastly increase the threat its nuclear program poses to the security of Northeast Asia,\" wrote analyst Frank Pabian and Siegfried Hecker, a Stanford University professor who visited North Korean nuclear sites in 2010",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Part of a picturesque toll highway that tourists use to travel between the Mexican towns of Ensenada and Tijuana collapsed this weekend, civil protection officials in Mexico said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "One of the holes created by the landslide was more than 40 feet deep and stretched 200 feet long",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "A cement truck was stuck when the ground started shifting, but the driver made it out safely, officials told CNNMexico",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The truck ended up tumbling into the Pacific Ocean, which is just west of the road",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Officials say it may take as long as a year to repair the damage",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Building a temporary road is one option being considered, authorities said",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "For now, motorists will use a nearby free road",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "It is unclear what caused the landslide",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "According to the United States Geological Survey, a magnitude-4.6 earthquake centered about 60 miles southeast of Ensenada struck on December 19, but the events might not be connected",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "On the Facebook page of the Baja California Civil Protection services, officials said the road is not in an area where there is a fault line",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The damage occurred about 60 miles from Mexico's border with the United States",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

