{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- An asteroid the size of an aircraft carrier passed within the moon's orbit Tuesday, the closest approach by an object that large in more than 30 years",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Asteroid 2005 YU55 passed within 202,000 miles of Earth -- about four-fifths of the distance to the moon -- at 6:28 p.m. Tuesday, NASA said",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Marina Brozovic, a researcher at NASA's Jet Propulsion Laboratory in California, said the space agency was able to train a great deal of high-powered instruments -- including the massive radio telescope at Arecibo, Puerto Rico -- on the asteroid as it approached",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"This is a rare event, and we learned a lot,\" Brozovic told CNN",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Follow space and science news on Light Years\n\nThough the space agency classified the asteroid as a \"potentially hazardous object,\" it posed no threat of a collision, according to NASA's Near Earth Object Program",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "If the asteroid had crashed into Earth, it could have caused a 4,000-megaton blast and a magnitude 7.0 earthquake, according to scientists at Purdue University",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "If it fell into the ocean, it could have caused a 70-foot-high tsunami within 60 miles of the crash site, the experts said",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The last time a space rock in the same league as 2005 YU55 passed as close to Earth was in 1976, NASA said",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The next similar encounter is projected for 2028, Brozovic said",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Podcast: Asteroid close encounter\n\nAs the object neared Earth, NASA studied the asteroid with the Goldstone radar antennas in California's Mojave Desert",
