{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Los Angeles, California (CNN) -- Officials had power fully restored Sunday afternoon after a 6.5-magnitude earthquake off the northern California coast Saturday left thousands without electricity",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake, which ran about 13.5 miles deep, hit at 4:27 p.m. Saturday, about 33 miles from the coastal city of Eureka, according to the U.S. Geological Survey",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Nearly a dozen aftershocks followed, the strongest at 4.5 magnitude",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "They continued into the early morning hours Sunday",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "David Eisenhower, spokesman for Pacific Gas and Electric Company, said power had been restored to all customers Sunday afternoon",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "About 28,000 customers, most in Humboldt County, were initially without power",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The company launched helicopters Sunday morning to patrol for gas leaks at the transmission lines that run through remote areas, he said, adding there have been no reports of such leaks",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "There were no reports of serious injuries or damage",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "See iReports from areas affected by earthquake\n\nSt. Joseph Hospital in Eureka said it treated several people for minor quake-related injuries, but none were significant enough for the patient to be admitted",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Chris Durant, a reporter for the Eureka Times-Standard, said he was working on the second floor of the newspaper's concrete building when he and his colleagues felt the earthquake",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "\"We are used to feeling small ones,\" he said, \"but after the first few seconds, we looked at each other and said, 'This is not a small one.'",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": "\"",
                "label": "no-unit"
            }
        ]
    ]
}

