{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Banda Aceh, Indonesia (CNN) -- Ten years ago, a towering wall of water engulfed cities across the Indian Ocean, ravaging communities as far afield as Thailand, Indonesia, Somalia and Madagascar",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The 2004 tsunami was sparked by a massive, 9.1 magnitude earthquake which struck off the western coast of northern Sumatra, Indonesia, on Boxing Day",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Aceh, Indonesia, located at the northern tip of Sumatra, bore the brunt of the tsunami, with an estimated 130,700 killed, 565,384 internally displaced while 199,766 houses were destroyed or damaged",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Plan International, a children's rights organization was one of the first organizations to provide humanitarian aid to the city",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Lamnga Elementary School, in Aceh, was reduced to a crumbled shell after the four-meter-high wave roared inland",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "How did school principal, Muhammad Saleh, struggling to cope with the loss of two daughters -- and nearly half his students - find the strength to rebuild a devastated school",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "?",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Reliving the tsunami\n\nIt was early Sunday morning, when the now 54-year-old school principal was making breakfast for his wife and three daughters",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The ground started to shake beneath their feet, and they realized that it wasn't like any other earthquake",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Panicked, they ran -- Muhammad with his four-year-old daughter cradled in his arms, while his two other daughters followed hand in hand",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Then the wave came",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Ten years later, Muhammad still remembers the moment he watched the wave pull his youngest daughter under, right before his eyes",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

