                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Aceh, Indonesia, located at the northern tip of Sumatra, bore the brunt of the tsunami, with an estimated 130,700 killed, 565,384 internally displaced while 199,766 houses were destroyed or damaged",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Plan International, a children's rights organization was one of the first organizations to provide humanitarian aid to the city",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Lamnga Elementary School, in Aceh, was reduced to a crumbled shell after the four-meter-high wave roared inland",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "How did school principal, Muhammad Saleh, struggling to cope with the loss of two daughters -- and nearly half his students - find the strength to rebuild a devastated school",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "?",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Reliving the tsunami\n\nIt was early Sunday morning, when the now 54-year-old school principal was making breakfast for his wife and three daughters",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The ground started to shake beneath their feet, and they realized that it wasn't like any other earthquake",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Panicked, they ran -- Muhammad with his four-year-old daughter cradled in his arms, while his two other daughters followed hand in hand",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Then the wave came",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Ten years later, Muhammad still remembers the moment he watched the wave pull his youngest daughter under, right before his eyes",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Washington (CNN) -- President Barack Obama met Monday with Japan's sixth prime minister in five years to try to strengthen ties with the Pacific economic power still struggling after last year's earthquake and tsunami that triggered a nuclear power plant meltdown",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The president and visiting Japanese Prime Minister Yoshihiko Noda started bilateral talks at the White House, to be followed by a working lunch and then a joint news conference",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Japan's volatile domestic politics, amid economic sluggishness and the March 2011 tsunami-triggered nuclear crisis, have made continuity a challenge in relations between the World War II enemies turned industrial allies",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Noda came to power in September, and last week, the two governments addressed a thorny issue of recent years with a plan for the United States to relocate about half of its 19,000 Marines based on Okinawa to other places in the Pacific region",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "While the relocation faces some opposition in Congress and Japan, the announcement of an agreement signaled a desire by the countries to work together on a way forward in bilateral relations",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "In addition, the two leaders will probably discuss North Korea's fledgling nuclear weapons program and political changes in Myanmar",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Another topic expected to come up Monday is possible Japanese membership in the Trans-Pacific Partnership, a trade alliance that is part of Obama's strategy to increase U.S. exports and influence in the Asia-Pacific region",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Participants so far in negotiations on the partnership include Australia, Brunei, Chile, Malaysia, New Zealand, Peru, Singapore, Vietnam and the United States",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Canada and Mexico also have expressed interest in joining",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Last month, Noda issued a sobering and reflective assessment of his country's recovery a year after the 9.0-magnitude earthquake, tsunami and nuclear meltdown at the Fukushima Daiichi plant",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The resulting release of radioactivity forced residents of several towns near the plant to flee their homes, and a 20-kilometer (12.4-mile) zone around the plant remains closed to the public",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

