        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Tokyo (CNN) -- A power company apologized Saturday and said the exposure of three workers at the Fukushima Daiichi power plant to highly radioactive water might have been avoided with better communication",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The Thursday incident has spurred questions about the source of the radioactive contamination in water, its potential to taint seawater nearby and the prospect it might be evidence of a leak in at least one of the facility's six reactor cores",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "It also prompted further criticism of the Tokyo Electric Power Co., which runs the plant, and how well it is safeguarding the nearly 500 people working to prevent more emission of potentially cancerous radioactive materials about two weeks after a 9.0-magnitude earthquake and subsequent tsunami rocked the facility",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "On March 24, three workers laying electrical cable in the turbine building of the No",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "3 reactor stepped in tainted water, exposing themselves to high levels of radiation",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Two suffered direct exposure on their skin",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
