{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Laura Silsby, the American missionary accused of trying to take nearly three dozen children out of Haiti after the devastating January 12 earthquake, has been freed from jail by a Haitian court, her defense attorney said Monday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Silsby is at the Port-au-Prince airport preparing to board an American Airlines flight to the United States, scheduled to depart at 5 p.m. (6 p.m",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "ET), said her lawyer, Chiller Roy",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Roy declined to comment on reports that Silsby had been convicted and freed on time served",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "A Haitian prosecutor was seeking a six-month prison sentence in the case",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Silsby was charged with trying to arrange \"irregular travel\" for 33 children she planned to take to an orphanage she was building in the Dominican Republic",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "She was jailed January 29, along with nine other American missionaries who were later released",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Last month, Judge Bernard Saint-Vil dropped kidnapping and criminal association charges against Silsby and the other missionaries",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "They were stopped while trying to take the children out of the country; authorities said the group didn't have proper legal documentation",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Silsby originally said the children were orphaned or abandoned, but the Haitian government and the orphans' charity SOS Children say that all have at least one living parent",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Some said they placed their children in Silsby's care because that was the only way they knew to ensure a better quality of life for them",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

