{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Survivors of a deadly earthquake-triggered tsunami which hit the Samoan islands Tuesday have described how they watched the inrushing sea swallow up coastal towns and villages leaving devastation in its wake",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "iReporter Alden Tagarino captured this image of the damage caused by the tsunami in Pago Pago",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "At least 111 people are confirmed killed in Samoa, neighboring American Samoa and Tonga",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "But officials in the Polynesia region have expressed fears the toll will rise as rescue workers struggle to reach outlying villages submerged and flattened by the wave",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "American Samoa resident Frances Faumatu told CNN she had fled to Aoloau, the highest village on the island, as the earthquake shook her house",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"All of a sudden we heard on the radio everybody had to run for safety,\" she said",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"Right after the quake, the tsunami came.",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Faumatu and others stayed on the mountain for two or three hours until the warning was lifted, watching as the sea swallowed Pago Pago, the island's capital, and then receded",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "At least 22 people are confirmed dead in the U.S. island territory",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Cars, debris, and parts of buildings were randomly strewn over the landscape where the powerful waters dropped them",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "See iReporter images of the aftermath \u00bb\n\nBut in some cases, the sea left nothing behind",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

