                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"All of a sudden we heard on the radio everybody had to run for safety,\" she said",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"Right after the quake, the tsunami came.",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Faumatu and others stayed on the mountain for two or three hours until the warning was lifted, watching as the sea swallowed Pago Pago, the island's capital, and then receded",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "At least 22 people are confirmed dead in the U.S. island territory",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Cars, debris, and parts of buildings were randomly strewn over the landscape where the powerful waters dropped them",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "See iReporter images of the aftermath \u00bb\n\nBut in some cases, the sea left nothing behind",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A communication breakdown has left people in anxious limbo around the globe with those outside Haiti not knowing whether loved ones there survived a major earthquake, and those in Haiti unable to get word out that they're safe",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "With few phone calls going through in the Caribbean nation in the aftermath of Tuesday's 7.0-magnitude quake, people were driven to texting, social networking sites and other online communication",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Thousands of people reached out through CNN's iReport Web page, posting pictures of missing loved ones and asking anyone with information to contact them",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Pleas for help filled page after page on iReports, including:\n\n\u2022 Johanna Neyra, who was trying to track down her cousin and his wife, Luis and Heidy Carazas",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Luis Carazas works for the Archdiocese of Port-au-Prince, in the Haitian capital",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"His family is very concerned in Peru,\" said Neyra, who waited for word of their fate, knowing the official Vatican newspaper had reported that Joseph Serge Miot, the Roman Catholic archbishop of Port-au-Prince, had died in the earthquake",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\u2022 Naeemah Carre of Garden City, New York, reported no success in trying to raise her brother and six other relatives via e-mail and Facebook",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "\u2022 New York City resident Marie Aline Sillice had not heard from her father, Frangel Victor Sillice, or her cousin Yvon Consean, who were to have been traveling outside the Haitian capital on Tuesday",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\u2022 Chico and Kathleen Boyer waited in Brooklyn, New York, to hear from daughter Maureen, who moved to Haiti two weeks ago",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "A number of aunts and cousins also were missing",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Maureen Boyer posted to her Twitter account late Tuesday afternoon, but had not been heard from since",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

