{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Chinese government authorities have intimidated and unlawfully detained parents and relatives of children who died in last year's Sichuan earthquake and harassed their supporters, an Amnesty International report said this week",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Rubble litters Beichuan, China, nearly a year after an earthquake killed thousands",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The 52-page report, released Sunday and titled \"Justice Denied: Harassment of Sichuan Earthquake Survivors and Activists,\" documented instances where parents and relatives said they had been detained for up to 21 days for trying to get answers from officials about their children's deaths",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Some said they had been detained several times",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"By unlawfully locking up parents of children who died, the government is creating more misery for people who have said in some cases they lost everything in the Sichuan earthquake,\" said Roseann Rife, deputy program director of Amnesty International Asia-Pacific",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"The government of China must cease harassing earthquake survivors who are seeking answers and trying to pick up the pieces of their shattered lives.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "CNN was not immediately able to get a response to the report from the Chinese government's Ministry of Civil Affairs and Ministry of Justice",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The report accused authorities of having prevented parents and relatives from complaining to higher officials about the quality of construction in the buildings that collapsed, referred to by critics as \"Tofu Dregs Construction.",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "It further alleged that many parents complained that their phones had been tapped and that they were arbitrarily detained so they would not be able to seek justice in the courts",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The human-rights organization called on Chinese authorities \"to take immediate action to address the grievances of survivors and relatives of those who were killed or injured\" during the 8.0 magnitude earthquake, which struck at 2:28 p.m. May 12, 2008, when many children were in school",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "As of September, official figures put the death toll at 69,227, with another 17,923 people missing",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
