{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "JAKARTA, Indonesia (CNN) -- Another strong earthquake rocked Indonesia early Thursday as the Southeast Asian nation was reeling from an earlier jolt that killed more than 200 people",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "A resident stands next to building that collapsed onto a car in Padang, Indonesia, on Wednesday",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The 6.8 magnitude quake Thursday hit southern Sumatra at 8:52 a.m. local time (0152 GMT), the Pacific Tsunami Warning Center said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Wednesday's earlier quake was 7.6 magnitude",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "At least 236 people are dead and more than 500 injured, the Indonesian Social Ministry's Crisis Center said Thursday",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "It said it had little information on the missing and feared the death toll would climb into the thousands",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The second quake was on a smaller scale than the first, said meteorology official Fauzi, who uses only one name",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "There were no damage reports yet",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Indonesian Health Minister Siti Fadilah Supari expected \"the casualties and the damage of this earthquake to be bigger than the 2006 Yogyakarta earthquake, given the intensity and the spread of the damage.",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The magnitude-6.3 Yogyakarta quake in central Java in May 2006 killed more than 5,000 people, triggered fears of an eruption of a nearby volcano and caused significant damage to a 9th century Prambanan temple",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Thousands may be trapped by collapsed buildings and houses, Rustam Pakaya, the head of the Health Ministry's crisis center, told CNN on Wednesday",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

