        ],
        [
            {
                "number": 6,
                "text": "A sea of people waved their arms in the air, prayed, cried, sang and -- where space permitted -- danced",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The earthquake is blamed for killing more than 212,000 people, injuring 300,000 and leaving more than 1 million homeless in the city of 3 million and surrounding communities",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The memorial took place near where the stately National Palace lies in ruins and the Champ de Mars square has been turned into a huge homeless camp",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Other memorials were taking place at shantytowns, and there were religious observations",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Haitians were urged to wear black or white",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "There was an outpouring of aid from around the world after the quake -- more than 600 aid agencies rallied -- but, initially, much of their work was ineffective because of the chaos, including the disruption of the government after its buildings collapsed",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Relief operations are improving day by day, a spokeswoman for the International Rescue Committee told CNN on Friday",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "\"Things [supplies] are moving now, and they are arriving to populations",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The bottleneck has really, really decreased,\" Aisha Bain said",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "A 7.3 magnitude earthquake rumbled early Saturday in the Pacific Ocean about 200 miles east of Japan's main island, the U.S. Geological Survey reported",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The Japanese Meteorological Agency issued a tsunami advisory for the Japanese coastal areas including the Fukushima prefecture, warning people to leave the coast.",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The same organization canceled all such advisories and warnings a short time later",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Sea levels might change slightly in some coastal locales, but no damage from a tsunami was expected, according to the agency",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The Pacific Tsunami Warning Center also said there was no widespread tsunami threat around the greater Pacific region",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Saturday's quake happened at about 2:10 a.m. local time, with an epicenter about 203 miles east-northeast of Tokyo, the USGS said",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The quake hit at a depth of about six miles",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The Fukushima prefecture was where a 9.0 magnitude earthquake and subsequent tsunami damaged several nuclear reactors in March 2011",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "More than 15,000 people were killed in that quake and tsunami, and material damage related to the incident was estimated to be about $300 billion",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

