{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Sakura, Japan (CNN) -- Residents of northern Japan streamed south from their earthquake-stricken hometowns Saturday, crowding stores in search of vital supplies as rescue teams worked north toward the historic quake's epicenter",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Roads and buildings showed cracks as far away as 200 kilometers (125 miles) from Sendai, the closest city to the epicenter",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "One man told CNN the scene in towns hit by the quake and the resulting tsunami was \"unimaginable.",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Shoppers were polite but tense as they sought food, water and gasoline from stores, where shelves were quickly emptied and pumps soon ran dry",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "A slow, steady line of cars trickled south from the disaster zone as people either left the area or shuttled to the stores, many of which were without power and had broken glass scattered down the aisles",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Japan's major highways, large sections of which are elevated, have been closed since the magnitude 8.9-quake struck off the northeastern coast Friday afternoon",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Automobile traffic crawled on smaller, two-lane roads as power outages left the sleek, electric-powered \"bullet trains\" -- shining examples of Japan's advanced technology, usually capable of speeds nearing 200 mph -- sitting motionless on their tracks",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Closer to the heart of the disaster, collapsed phone lines and towers left communications spotty",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Roads and airfields were washed out by the tsunami; rescue workers headed to the stricken region had to rely on helicopters",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Video from Sendai showed people trapped in the second floors of homes, waving sheets of white cloth in hopes of drawing rescue workers",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Residents who have been able to call out reported gas and water were unavailable for a radius well beyond the city of about 1 million",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

