            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN)In a tragic echo of the catastrophic events in Haiti in 2010, a powerful earthquake struck one of the poorest nations on Earth today",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The latest estimates from seismologists put the magnitude at 7.9, which would actually makes it about 40% larger than the 7.8 currently being reported",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "That's less than half the size of the previous major event nearby in 1934, which killed around 10,000 people",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Unfortunately, it is quite possible the number of dead in Kathmandu could rise to match it",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "We knew this disaster was coming eventually",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Geophysicists have long monitored how fast the Earth's plates are moving, and we know that the entire subcontinent of India is being driven slowly but surely underneath Nepal and Tibet at a speed of around 1.8 inches per year",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "It's the reason Everest exists",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Latest updates on Nepal earthquake\n\nOver millions of years, the squeezing has crushed the Himalayas like a concertina, raising mountains to heights of several miles and triggering earthquakes on a regular basis from Pakistan to Burma",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Saturday's quake was neither unusual nor unexpected, although it was larger than most",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "In the 81 years since the 1934 Bihar earthquake, the land mass of India has been pushed about 12 feet into Nepal",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Think of all that movement getting stored in a giant spring lying under Nepal",
                "label": "sentence"
