{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A magnitude 7.0 earthquake struck Haiti two years ago, sending an already struggling nation into a tailspin",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Relief organizations estimate that more than 300,000 people were injured, nearly 5,000 schools were damaged or destroyed, and 1.5 million people were left homeless",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The quake affected one-third of the country's population, according to USAID",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "A cholera outbreak confirmed in late October 2010 and flooding from Hurricane Tomas in November aggravated dire conditions",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"This water now came by and washed away anything we had left,\" Leogane resident Charlie Simolien said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Recovery efforts have transitioned from relief to rebuilding, but more than half a million people still live in displacement camps, according to the United Nations Office for the Coordination of Humanitarian Affairs",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "From the economy and education to health care and homelessness, relief organizations remain in Haiti, working to meet the ongoing needs of the Haitian people, and there are ways you can help",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "MFK fights malnutrition, creates jobs\n\nMeds & Food for Kids (MFK) develops, produces and distributes \"Medika Mamba,\" Creole for peanut butter medicine, and other nutritious foods to fight malnutrition",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "When the earthquake hit in 2010, MFK distributed more than 40,000 pounds of Medika Mamba to malnourished children and patients recovering from amputations and surgery",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Today, MFK continues its nutrition programs across the country",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "A new factory opens this summer and will expand production tenfold",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

