{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Santo Domingo, Dominican Republic (CNN) -- Trapped beneath his collapsed home in Port-au-Prince, rescuers had to amputate Georges Exantus' right leg in order to free him",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "He was one of the survivors from Haiti's January 12 earthquake that killed more than 200,000 people",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Exantus, 29, was quickly rushed to a hospital in neighboring Dominican Republic, where he spent over two months recovering",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Now, he is waiting at a bus stop in Santo Domingo, heading back to Haiti",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Back to uncertainty",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Back to zero",
                "label": "sentence"
            },
            {
