{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "MEXICO CITY (CNN) -- A moderately strong earthquake rocked Mexico City on Friday afternoon, shaking the earth in the sprawling capital",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "People in Mexico City stream into the street as a magnitude 5.7 earthquake hits",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The U.S. Geological Survey measured the quake at magnitude 5.7, and placed the epicenter near the city of Puebla, about 85 miles southeast of Mexico City",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "It hit at 2:24 p.m. local time",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The Mexican seismological service measured the quake at 5.9",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "People in the city reported the earth and buildings shaking",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Thousands of panicked people streamed into the streets as stopped cars snarled traffic",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Parts of the city were without electricity Friday afternoon but there were no immediate reports of injuries or damage",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Earthquakes are a frightening experience for the 20 million residents of Mexico City, where thousands of people perished in a massive quake in 1985",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The city, built on volcanic ash and clay, is particularly vulnerable to temblors",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Aldo Pontecorvo of the humanitarian agency World Vision said the shaking lasted about 20 seconds",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

