{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "The Washington Monument remains \"structurally sound\" and is \"not going anywhere,\" a top National Park Service official said Monday, announcing the result of a comprehensive assessment of the structure's interior",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "A five-day examination of the monument's exterior will begin Tuesday, according to Bob Vogel, superintendent of the National Mall and Memorial Parks",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Four cracks in the monument's marble were discovered shortly after a 5.8-magnitude earthquake struck the East Coast on August 23",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The monument has since been closed to the public",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Officials declined to say Monday when the monument will re-open",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Small pools of standing water were found in the monument during inspections following Hurricane Irene, the National Park Service said in late August",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"What happened was a lot of mortar popped out, so much so that you can see sunlight above 450 feet in the monument,\" spokeswoman Carol Johnson said at the time",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The National Park Service has been working with an engineering firm to determine the extent of the damage and what it will cost to fix it",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Repairs will include pinning several stones together and replacing some mortar, Johnson noted",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The Washington Monument, built between 1848 and 1884, is 555 feet, 5 and one-eighth inches tall",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Its walls are 15 feet thick at the base and 18 inches at the top, and are composed primarily of white marble blocks, according to the National Park Service",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

