{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Tokyo (CNN) -- Nissan has started scanning vehicles made in Japan for traces of radioactive material, a company official said Friday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "\"Looking ahead, we will continue to implement all appropriate measures to reassure the public that all products from our company remain within globally accepted safety standards and until we are confident that any risk of contamination is completely removed,\" said Simon Sproule, corporate vice president of marketing for Nissan Motor Company",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Sproule said the monitoring began this week",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Sources inside the company said there is virtually no risk of contamination from a car and no potential health risk to customers, but testing began because of public concern",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Production at several Nissan facilities remains suspended after a 9.0-magnitude earthquake damaged plants and equipment on March 11, the company said in a statement Thursday",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

