{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- It's been three years since Japan was hit with its worst-ever earthquake, causing serious damage to Fukushima Daiichi nuclear power plant",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The 9 magnitude quake and subsequent tsunami sent three of Fukushima's reactors into melt-down, shocking the world",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Japan, a fully industrialized country with high safety requirements, was facing a nuclear disaster of a similar scale to the deadly 1986 Chernobyl accident, in Soviet Ukraine",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "As a result, many countries decided to review their energy policies",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Before the accident, 442 nuclear power reactors in 30 countries produced 14% of all world's electricity",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "This number dropped to just 11% in 2012, as 15 reactors exited service -- mainly in Germany and Japan",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Today, 435 reactors operate in 31 countries, and a further 68 are under construction",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "After the Fukushima disaster, Japan pulled back its nuclear ambitions, ordered large-scale inspections and introduced new safety regulations",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "All of its 48 remaining reactors have been kept offline and a proposal to restart the program awaits parliament's approval",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Germany shut down eight of its oldest reactors almost immediately after Fukushima, focusing instead on renewable energy, and phase-out all of its nuclear power by 2022",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Switzerland adopted a similar approach when the government decided not to build any new reactors and phase out its nuclear production by 2034",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

