{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Minamisoma, Japan (CNN) -- The scene of sheer devastation left by powerful tsunami waves looked sadly familiar: trucks slammed into houses, uprooted trees and downed power lines soaked in muddy water, while time stood still inside abandoned homes with unmade beds and scattered stuffed toys",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "It was the eerie combination of sounds that stood out as I surveyed a deserted village on this chilly Wednesday morning: Rustling of dangling tin sheets in gusty wind, my own breathing behind a face mask and the constant beeping of my Geiger counter",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "My colleagues and I had just entered the 20-kilometer exclusion zone, a radius Japanese authorities drew around the Fukushima Daiichi power plant and ordered some 78,000 residents evacuated in the early days of the crisis, now the worst nuclear accident since Chernobyl",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The March 11 twin disasters of a 9.0-magnitude earthquake and the ensuing tsunami in northeastern Japan have resulted in the plant belching radioactive particles into the surrounding environment",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Driving for two hours on winding highways from the Fukushima train station, we had passed through rural Japan's alternating scenes of snow-covered mountains and green valleys in full bloom -- until we reached a checkpoint with a big \"no-entry\" sign and flashing red lights",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "A friendly police officer, however, waved us through, after emphasizing the need to don face masks despite the relatively low reading on radiation",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Our shoes tightly wrapped in paper booties, we finally stepped onto the soil inside the so-called hot zone, some 18 kilometers north of the stricken nuclear plant",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "With parts of the ground still wet from days of rain, we avoided murky puddles to minimize the risk of cross-contamination",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The numbers on our Geiger counters fluctuated while the alarms -- with base level set low -- kept going off",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Still, we faced no danger of being exposed to anything that would harm human health",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Cars zipped by occasionally as residents were allowed in to check on homes and businesses, but the only other sign of life appeared to be farm animals -- a few cows, horses and chickens -- left behind that have grown gaunt",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

