                "text": "The numbers on our Geiger counters fluctuated while the alarms -- with base level set low -- kept going off",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Still, we faced no danger of being exposed to anything that would harm human health",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Cars zipped by occasionally as residents were allowed in to check on homes and businesses, but the only other sign of life appeared to be farm animals -- a few cows, horses and chickens -- left behind that have grown gaunt",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A strong earthquake struck coastal Chile near the port city of Valparaiso late Monday, causing mudslides and some minor damage, the U.S. Geological Survey reported",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The 6.7-magnitude quake knocked out some power and phone lines in the region, authorities said",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The temblor was felt in the capital city, Santiago, located 69 miles from the epicenter",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "A CNN en Espa\u00c3\u00b1ol anchor held onto his desk as the quake rattled the studio during a newscast in Huechurba, a suburb of the capital",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"We could feel the ground shaking,\" said journalist Richard Madan",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"It felt like we were standing on a subway track but multiply that by about 200.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Madan, of CNN's Canadian affiliate CTV, is in Santiago as part of the traveling press for Canadian Prime Minister Stephen Harper's visit there",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Both he and the Canadian delegation were okay, Madan said",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "No tsunami warning was issued, according to Chile's Hydrographic and Oceanographic Service, and a preventive evacuation for the area has been lifted",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "A 72-year-old man died of a heart attack during the evacuation, according to regional Mayor Raul Celis",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The same part of the country was hit with an 8.8-magnitude earthquake in February 2010, killing hundreds of people",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

