{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN Student News) -- October 1, 2009\n\nQuick Guide\n\nSamoa Earthquake - Understand how seismic events, like the Samoan quake, can spawn tsunamis",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Iran's Inspections - Hear the International Atomic Energy Agency's stance on Iran's nuclear program",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Longer School Day - Consider the potential pros and cons of a plan to extend the U.S. school day",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Transcript\n\nTHIS IS A RUSH TRANSCRIPT",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "THIS COPY MAY NOT BE IN ITS FINAL FORM AND MAY BE UPDATED",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "CARL AZUZ, CNN STUDENT NEWS ANCHOR: Kicking off a new month of commercial-free news, I'm Carl Azuz and this is CNN Student News",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "!",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Glad to have you with us",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "First Up: Indonesian Earthquake\n\nAZUZ: We begin in Indonesia, where officials are working to determine the full impact of a major earthquake",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The difficulty is that the tremor, which struck around 5 p.m. local time yesterday, caused widespread power and phone outages",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Initial reports did indicate that the quake killed at least 75 people",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Officials believe hundreds more may be injured and thousands may be trapped",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

