{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "CIANJUR, Indonesia (CNN)  -- More than a day after a major earthquake jolted Indonesia's Java Island, killing at least 57 people, there is still no word from remote villages along the coast, a relief worker told CNN Thursday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Soldiers try to dig out the body of a victim buried by a landslide caused by the earthquake",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "\"This earthquake has injured hundreds of people and (destroyed or damaged) thousands of houses,\" World Vision's Katarina Hardono said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"We worry that the number can be easily more because in many places, actually the coastal areas, we still (haven't gotten) any news.",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Rescuers are still searching for dozens of people feared trapped in a quake-triggered landslide in Cianjur in West Java",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "They pulled several bodies from the rubble Thursday bringing the death toll from the quake to 57",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"The death count has been thankfully low, but we have to remember that tens of thousands of homes have been damaged or destroyed and children and adults are urgently in need of relief items,\" said Hardono, who spoke to CNN from the Indonesian capital, Jakarta",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Rainfall Thursday hampered the rescue efforts in Cianjur, where the landslide buried at least 11 homes where 32 people live, local officials said",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Watch description of the evacuation after the quake hit \u00bb\n\nIndonesian President Susilo Bambang Yudhoyono visited Cianjur, and vowed to free up nearly $500,000 (5 billion rupiahs) for emergency response efforts, according to the state-run Antara news agency",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "He said there was no need for foreign assistance just yet",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "\"Until now the Indonesian government is still able to handle it by itself using existing national resources,\" he said, according to Antara",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

