{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Christchurch, New Zealand (CNN) -- The death toll from the 6.3-magnitude earthquake that demolished parts of Christchurch, New Zealand, last week has climbed to 147, authorities said Sunday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The figure is expected to rise, the Ministry of Civil Defence and Emergency Management said",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Seventy people have been rescued alive from the quake that struck Tuesday, the agency said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Police in the battered town said Friday that more than 200 people still missing",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Many of the missing were feared dead",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Included in that were all the people who were in the Canterbury TV building that toppled in the Tuesday earthquake",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Police say they have \"grave fears\" for all who were in the building including 90 students and staff from the King's Education language school -- headquartered on the third floor",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Donna Tai Rakena's husband Tetaki was an English teacher and was working there when the quake struck",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "After the shaking ceased, she said she called his cell phone and got no answer",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "She jumped on her bike and pedaled down to the fallen building to see if she could find her husband in the mess of mangled steel and rubble",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Police broke the news to her: Her soul mate of 30 years, the man she affectionately called Wally, was believed to be dead",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

