        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "United Nations (CNN) -- The United Nations Security Council has approved a proposal to send an additional 2,000 soldiers and 1,500 police officers to quake-ravaged Haiti, U.N. Secretary-General Ban Ki-moon said Tuesday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "By its approval of the plan Monday, \"the council sends a clear signal: The world is with Haiti,\" Ban said",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "He said he was confident that member states would respond quickly in order to get the troops on the ground as soon as possible",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
