{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- One of the emergency responders at last month's deadly Texas fertilizer plant explosion is now charged with possessing materials for a pipe bomb, a court document states",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Authorities on Friday said they are launching a criminal investigation into last month's blast in the town of West, but have not said if the arrest of Bryce Reed is connected",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Local sheriff's deputies were called on Tuesday to a residence where they found components for a pipe bomb, according to a criminal complaint affidavit",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The officers determined that Reed had given the materials to the resident of that home last month",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Among the materials found were a galvanized metal pipe, a fuse, coils of metal ribbon and several bags of chemical powders, the affidavit states",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Reed, who was arrested early Friday, is charged with possession of a destructive device",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"At this time authorities will not speculate whether the possession of the unregistered destructive device has any connection to the West fertilizer plant explosion,\" the U.S. attorney's office for the Western District of Texas said in a release",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "If convicted, Reed would face up to 10 years in prison and a $250,000 fine",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Reed spoke last month at a memorial for the victims at Baylor University",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The arrest details came as authorities said they conducting a thorough criminal investigation into the April 17 fire and explosion that killed 14 in the small town of West",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "\"This disaster has severely impacted the community of West, and we want to ensure that no stone goes unturned and that all the facts related to this incident are uncovered,\" DPS Director Steven McCraw said",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

