        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A magnitude 8.2 earthquake struck the Russian Far East on Friday, the U.S. Geologicial Survey reported",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The epicenter for the extremely powerful quake was located in the Sea of Okhotsk, just to the west of the Kamchatka Peninsula, and about 600 kilometers (nearly 375 miles) underground",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The quake was felt for five minutes in the region, Russia's Ria Novosti news agency reported",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Many people ran into the streets as the temblor shook",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "No tsunami warnings were issued in the quake's immediate aftermath",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The region is located along the Pacific \"ring of fire,\" an area of high seismic and volcanic activity stretching from New Zealand in the South Pacific up through Japan, across to Alaska and down the west coasts of North and South America",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "CNN's Boriana Milanova contributed to this repor",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": "t",
                "label": "no-unit"
            }
        ]
    ]
}

