{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Port-au-Prince, Haiti (CNN) -- Haiti's capital awoke to increasing desperation Thursday morning, a day and a half after a devastating earthquake, with covered bodies piling up along streets and modern aspects of life, such as electricity, mostly missing",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The streets of Port-au-Prince resembled grainy black-and-white newsreels from World War II that showed the rubble of bombed-out houses in Berlin and London",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The devastation was wide and often horrific",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "A one-hour drive from the airport to a walled-in hotel where the CNN contingent is staying revealed the widespread destruction from Tuesday's 7.0-magnitude earthquake",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Flattened and severely damaged houses were found on every block, and the streets were choked with pedestrians and residents",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "They set up overnight camps and slept by the thousands in dark and crowded parks and on sidewalks, for fear of being inside if another powerful quake hit",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Numerous aftershocks have rattled the capital",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Sporadic gunfire was heard Wednesday night outside the hotel where CNN is lodged",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
