{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Port-au-Prince, Haiti (CNN) -- Raymond Thomas is a jolly man who laughs easily and likes to say \"Forget it\" a lot",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "He'd like to forget the devastation wrought at the Port-au-Prince harbor where his fleet of trucks used to pick up cargo",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Tuesday's 7.0-magnitude earthquake sent a quarter-mile pier crumbling into the sea along with two of his trucks",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The few workers who went into the water swam to safety, Thomas said, but the port remains shut down, and desperately needed aid cannot be unloaded quickly",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"Now we're just starving to death,\" he said, worried that the airport and smaller harbors cannot handle the necessary volume of relief supplies",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"That was the whole country right there,\" he added, pointing at two toppled cranes on the remains of the pier that stand out against the clear-blue sky",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Thomas owns Raymond and Sons Trucking, a fleet of 35 trucks that haul cargo from the port",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The company employed about 50 employees, all of them now out of work",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\"I'm out,\" Thomas said",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The port won't be back for a while",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Roads have been split apart and buckled, fences have fallen over",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

