{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Washington (CNN) -- Just days after a magnitude 5.8 earthquake cracked the Washington Monument in four places, the National Park Service is trying to protect it from being further damaged by Hurricane Irene, spokeswoman Carol Johnson said Friday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Engineers for the National Park Service are working inside the Washington Monument to \"plug holes and catch anything that they can't plug,\" Johnson told CNN",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "\"We have a group of people who are on ropes up there, trying to pin and plug whatever they can.",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The engineers are using a flexible insulation called backer rod",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"They are basically jamming it into the cracks,\" Johnson said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"They are doing what they can and putting this backer rod in and then they are going to go back up and inspect after the storm,\" she added",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "One area of special concern -- the most extensive damage to the stonework near the top caused by Tuesday's earthquake",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "\"The crack is about 4 feet long and 1 inch wide and in some places wider and you can see sunlight through the crack,\" Johnson said",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The monument is closed indefinitely to the public while engineers assess the damage caused by the quake",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Even without the new cracks, the monument would have experienced seepage because of the way it was built, according to Johnson",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "\"The anticipation is there will be more water because of these cracks",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

