                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "\"The anticipation is there will be more water because of these cracks",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Tuesday's Virginia earthquake triggered the shutdown of a nearby nuclear power plant and spurred declarations of \"unusual events\" at plants as far away as Michigan, U.S. authorities reported",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Dominion Virginia Power said both reactors at its North Anna plant, less than 20 miles from the epicenter of the magnitude-5.8 quake, shut down automatically after the first tremors",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Amanda Reidelbach, an emergency management spokeswoman for Louisa County, said the plant vented steam, but there was no release of radioactive material",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "David Heacock, the utility's chief nuclear officer, said the 1,800-megawatt plant was operating on emergency power and the two pressurized-water reactors were safely deactivated",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"The plants are designed for this kind of a seismic event,\" Heacock said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"There is no apparent damage to anything at the plant right now.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Crews were working to restore off-site power to the plant Tuesday evening, the utility said",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Dan Stoddard, senior vice president of nuclear operations for Dominion, said some power from the grid had been restored to the reactors and it was possible full power could be achieved late Tuesday",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "It was not clear if a 4.2-magnitude aftershock Tuesday evening would affect the operation",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Stoddard said there was no damage to the spent fuel pool",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The diesel generators supplying backup power have enough fuel to operate 30 days and more can be brought in, if needed, Stoddard told CNN\n\n\"The power plant is safe,\" Stoddard said",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

