{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A 6.2-magnitude earthquake struck off Japan's eastern coast early Tuesday, the U.S. Geological Survey reported",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "With a depth of 9 kilometers (5.6 miles), the tremor was about 96 kilometers (almost 60 miles) east-northeast of Miyako and 550 kilometers (342 miles) north-northeast of Tokyo, according to the U.S. agency",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The quake occurred just over a year and a half since a 9.0-magnitude earthquake triggered a huge tsunami off Japan, resulting in thousands of deaths and the world's worst nuclear crisis in a quarter century",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The Japan Meteorological Agency, however, did not issue any tsunami warnings or advisories immediately after the Tuesday morning quake, according to its website",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "No such warnings were issued by the Pacific Tsunami Warning Center either",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "A little more than 30 minutes after this first earthquake, another significant, if slightly weaker one, hit the same general area",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "This 5.1-magnitude tremor was about the same distance from Tokyo as the first and about 107 kilometers (66 miles) east of Miyako -- which was among the areas devastated by the March 2011 earthquake and tsunami -- according to the U.S. Geological Survey",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Tuesday's second quake was much deeper than the first, rooted about 38 kilometers (23.6 miles) below sea level",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

