{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Washington (CNN) -- While stone carvers chisel new pieces to repair damage inflicted on the Washington National Cathedral by an earthquake last August, fundraisers say the cathedral's restoration fund is $18 million short of the repair cost",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The cathedral, sometimes called \"the spiritual home for the nation,\" was perhaps the hardest-hit landmark in the capital when a magnitude 5.8 earthquake struck on August 23",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The Gothic cathedral's three towers and the carved pinnacles and embellishments that decorate them were severely affected by the earthquake",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"The repair work, which includes intricate stone carving and detailed masonry, and will require significant scaffolding and large cranes to access the damaged areas, could be completed in five years if sufficient funds are raised immediately,\" the cathedral said in a news release",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Carvers are fabricating new stones from blocks of limestone taken from the original quarries in Indiana, it said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "A total of $2 million was raised over the past six months to cover the cost of stabilizing damaged stones and protection to allow the cathedral to reopen, it said",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The total repair cost, initially estimated at $15 million, is now expected to be more than $20 million, leaving another $18 million to be raised, it said",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

