{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(Fast Company) -- An earthquake with a magnitude of 8.9 hit Japan today, resulting in tsunami warnings for 20 countries, as well as California and Hawaii",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Crisis mappers wasted no time responding: In under 2.5 hours Google launched its person finder application, which was also used when New Zealand's 6.3 quake struck last month, and a local developer in Tokyo, Shu Sigashi, a member of the OpenStreetMap Foundation in Japan, quickly put up a localized Ushahidi crisis platform",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Crisis mapping's reach only goes as far as it is utilized, so the key now is getting the word out that online tools are available to help report the missing",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Google's person finder app is already rapidly increasing in usage",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Within a couple hours 2,000 reports had been logged",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "If you type in the name, \"Yoshi,\" in Google's app, results come up that indicate whether people with that name have been reported as alive or missing",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Hawaii's Pacific Disaster Center has updated tsunami warnings and an interactive map with information on the risks present on each island",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The UN satellite monitoring group that teamed up with Google and George Clooney in Sudan could also be activated at the request of the Japanese government at any moment",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\"We're on standby basically,\" UNOSAT's Lars Bromley tells Fast Company",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
