{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Twenty-five of 27 spent-fuel storage casks at a Virginia nuclear plant were shifted between 1 and 4 inches during last week's 5.8-magnitude earthquake, officials said Thursday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The cylinders, each 16 feet tall and weighing 115 tons, were not damaged, and no radiation was released, said Rick Zuercher, spokesman for Dominion Virginia Power, which operates the North Anna Power Station near Louisa, Virginia",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Monitors were hooked up to the casks to determine any abnormalities, he said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "He said the casks' movement was known shortly after the quake, which had an epicenter less than 20 miles from the plant, but the news was not released to the public",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"We had a lot going on,\" Zuercher said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"There was no indication of any problem ... and there isn't any problem.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Besides those casks, which are vertical, some of the horizontal bunkers holding spent fuel also were affected",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The concrete \"came loose on the face\" of \"a few\" of the bunkers, Zuercher said, but the damage is not considered serious",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The bunkers -- of which 13 of the 26 hold rods -- are each 16 feet long and weigh 50 tons",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "It is the first time such casks have been shifted by an earthquake in U.S. history, said Roger Hannah, spokesman for the Nuclear Regulatory Commission, as it's the first time a quake of this magnitude was felt at a nuclear plant in the country",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The safety standards for such casks, he said, are \"unbelievable.",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": "\"",
                "label": "no-unit"
            }
        ]
    ]
}

