{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "LOS ANGELES, California (CNN) -- A magnitude-5.4 earthquake shook the Los Angeles metropolitan area Tuesday, leaving residents rattled but causing no serious damage or injuries",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Bricks and other debris clutter an alleyway in Pomona, near Los Angeles Tuesday afternoon",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "However, the temblor served as a warning to southern Californians who had not experienced an earthquake in some time: the \"Big One\" remains a possibility",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"This is a sample, a small sample,\" said Kate Hutton, a seismologist at the California Institute of Technology",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"This is somewhere between small and moderate.",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "She said there is a 5 percent chance the quake could be a precursor to a larger earthquake",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "After 24 hours, she said, that chance will drop to 1 percent",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "\"Every earthquake relieves some stress,\" Hutton said",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\"It's usually only a drop in the ocean",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "In other words, the amount of stress released by this earthquake is minuscule compared to the amount that's built up and is building up for the Big One when it happens some day in the future.",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Watch Hutton say Tuesday's quake was a sign of bigger ones to come \u00bb\n\nAnd when will that be",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": "?",
                "label": "no-unit"
            }
        ]
    ]
}

