                "number": 14,
                "text": "After 24 hours, she said, that chance will drop to 1 percent",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "\"Every earthquake relieves some stress,\" Hutton said",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\"It's usually only a drop in the ocean",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "In other words, the amount of stress released by this earthquake is minuscule compared to the amount that's built up and is building up for the Big One when it happens some day in the future.",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Watch Hutton say Tuesday's quake was a sign of bigger ones to come \u00bb\n\nAnd when will that be",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": "?",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "New Delhi (CNN) -- A group of locals looked on warily as we filmed our piece inside a congested, riverside Delhi neighborhood",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "And they've every reason to feel nervous",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "A number of deadly collapses in recent months have thrust the issue of illegally constructed and unsafe housing into the spotlight",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "On June 28, a four-story building in the city suddenly toppled over killing 10 people, including five children",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "That same day, an eleven-floor building under construction came crashing down in the southern Indian city of Chennai, killing 61 workers",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Both incidents made headlines outside India -- and rightly so",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "But for many of the people living in these neighborhoods, the publicity is not necessarily welcome",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "That's because they're among the poorest and most vulnerable -- on one hand they fear for the safety of their homes, and on the other they fear being forcibly evicted and their homes destroyed",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "They have nowhere else to go",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "So when TV crews arrive, many are understandably defensive",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "As we filmed in Laxmi Nagar, a neighborhood of eastern Delhi located along the Yamuna River, pockmarked with ramshackle residential blocks, a man approached us and questioned whether we had the right to film",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

