{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- In September 1985 a devastating earthquake measuring 8.1 on the Richter Scale smashed into Mexico City killing 10,000 people and leaving parts of the city in ruins",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Since then, the populous Latin American nation of 122 million has invested in one of the most advanced seismic warning systems anywhere in the world",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The SASMEX facility came online in 1991 and reacts to data gathered by sensors placed near major fault lines along Mexico's Pacific coast",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Receivers dotted around five major cities, including Mexico City and Acapulco, will sound the alarm if they detect an earthquake",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "It's a system that can buy vital seconds for residents to brace themselves before the tremors begin",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "But not everyone has access to a SASMEX receiver -- there are 100,000 in operation but at a cost of roughly $330 apiece, they are a luxury the majority of Mexicans can't afford",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Most receivers are stationed in the likes of public buildings, hospitals, schools and subway stations",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "With roughly 21 million people living both formally and informally in and around Mexico City alone, that means many will not be aware the alarm is sounding until the ground begins shaking",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "$50 alarm\n\nAccording to local tech entrepreneur, Andres Meira, such vital services should be far more widely available",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Meira is no passive observer in this debate",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "He moved to Mexico City after working in Haiti and witnessing the devastation caused by the 7.0 magnitude earthquake that struck the Caribbean island in 2010 killing more than 230,000 people",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

