{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Jakarta, Indonesia (CNN) -- A magnitude 7.3 earthquake struck early Wednesday off the west coast of the Indonesian island of Sumatra, the U.S. Geological Survey reported, but witnesses reported only minor shaking on land",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake was centered in the northern Indian Ocean, more than 400 km (250 miles) off northern Sumatra and more than 29 km (18 miles) beneath the surface",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Indonesian authorities initially issued a tsunami warning for the area, before lifting it a couple of hours after the first quake struck",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The Hawaii-based Pacific Tsunami Warning Center said there was no threat of a massive wave like the one that devastated the region in 2004",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The quake hit at 12:37 a.m. Wednesday (1:37 p.m. Tuesday ET), according to the USGS",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "There were no immediate reports of damage, and hotel clerks contacted by CNN reported only mild shaking",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "One front desk clerk in Aceh said a few hotel guests went outside when the quake hit, but most weren't awakened",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The region is highly active seismically, and a magnitude 9.1 quake in December 2004 generated a tsunami that killed people as far away as eastern Africa",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The death toll from the combined disaster topped 280,000 in a dozen countries, most of them in Indonesia",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "CNN's Kathy Quiano contributed to this report",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

