{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Jakarta, Indonesia (CNN) -- A magnitude 7.3 earthquake struck early Wednesday off the west coast of the Indonesian island of Sumatra, the U.S. Geological Survey reported, but witnesses reported only minor shaking on land",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake was centered in the northern Indian Ocean, more than 400 km (250 miles) off northern Sumatra and more than 29 km (18 miles) beneath the surface",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Indonesian authorities initially issued a tsunami warning for the area, before lifting it a couple of hours after the first quake struck",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The Hawaii-based Pacific Tsunami Warning Center said there was no threat of a massive wave like the one that devastated the region in 2004",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The quake hit at 12:37 a.m. Wednesday (1:37 p.m. Tuesday ET), according to the USGS",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "There were no immediate reports of damage, and hotel clerks contacted by CNN reported only mild shaking",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "One front desk clerk in Aceh said a few hotel guests went outside when the quake hit, but most weren't awakened",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The region is highly active seismically, and a magnitude 9.1 quake in December 2004 generated a tsunami that killed people as far away as eastern Africa",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The death toll from the combined disaster topped 280,000 in a dozen countries, most of them in Indonesia",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "CNN's Kathy Quiano contributed to this report",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- There's no need to tell football fans in Seattle to take it up a notch",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "They're doing just fine, thank you",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "After setting a Guinness World Record for noise at an outdoor stadium in September, CenturyLink Field went seismic during Monday Night Football, registering as an earthquake at a recording station about a block from the stadium",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "How big, you ask",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": "?",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "In the magnitude 1-to-2 range, according to John Vidale, a professor at the University of Washington and the director of the Pacific Northwest Seismic Network",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Vidale said his staff recorded five separate seismic events during Seattle's 34-7 pasting of New Orleans -- a match-up of two of the NFL's top teams",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The most intense episode came late in the first quarter, when Seahawks defensive lineman Michael Bennett returned a Saints fumble 22 yards for a touchdown",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Seattle fans did this once before",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "In 2011, a Marshawn Lynch touchdown shook the earthquake recording station too",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "And in 1988, college fans at Louisiana State University rocked the bayou in a come-from-behind victory over 4th-ranked Auburn, registering on the campus seismograph",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

