{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Tokyo (CNN) -- Journalists got their first ground-level glance Saturday around Japan's stricken Fukushima Daiichi nuclear facility -- eying shells of reactor buildings, tons of contaminated water and workers scurrying still to mitigate damage from a crisis that began eight months ago",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "An epic 9.0-magnitude earthquake and subsequent tsunami March 11 wreaked havoc around Japan, killing more than 15,000 people",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "While many of those died instantly, the East Asian nation was on edge for weeks as utility and government employees scrambled to prevent a worsening nuclear catastrophe at the Daiichi plant, located about 150 miles (240 kilometers) north of Tokyo",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Japan's Nuclear and Industrial Safety Agency eventually categorized the accident as a level-7 event on the international scale for nuclear disasters -- the highest level -- putting it on par with the 1986 Chernobyl disaster",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "It took months, but the Tokyo Electric Power Company (the plant's operator) eventually indicated that its workers were gaining control in the crisis",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Throughout the summer and fall, there were no longer reports of explosions, nor stories about new leaks of radioactive material into the ground and sea",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "But the facility still remained off-limits to reporters and, for a 20-kilometer radius around the plant, to the general public due to the continued high levels of radiation and ongoing efforts to prevent yet more blasts and leaks",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "That temporarily changed Saturday, when about three dozen journalists traveled by bus through abandoned towns en route to the nuclear facility",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "They passed, for instance, withered plants at an abandoned nursery, a shattered car dealership and a gas station that had been taken over by crows",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Radiation readings rose steadily as they neared the plant, including 6.7 microsieverts in Okuma",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "There, those on board put on respirator masks, adding to an ensemble of a protective suit, two pairs of gloves, two sets of plastic booties over their shoes and a radiation detector",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

