{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Tokyo (CNN) -- Japan's largest utility said Thursday that more radiation than previously thought was released into the atmosphere in March 2011, in the days after the nuclear disaster that followed an earthquake and tsunami",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "TEPCO (Tokyo Electric Power Co.) estimates about 900,000 terabecquerels of radioactive materials were released between March 12 and March 31, according to Japan's Kyodo news agency",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "This is more than the estimates issued by the Nuclear Safety Commission of Japan or the government's nuclear safety agency, the news agency said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The utility said the release of radioactive material after March dropped sharply",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Hard lessons for U.S. nuclear safety from Fukushima meltdown\n\nThe latest figures from TEPCO come a day after the World Health Organization released a report on radiation doses that said infants living in the communities worst affected by the meltdown at the Fukushima Daiichi plant were exposed to much higher than normal levels of radiation",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "In one town in the Fukushima area, the estimated thyroid doses to infants are within a dose band of 100 to 200 millisieverts (mSv), the preliminary report said",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "This level of radiation exposure could be associated with an increased likelihood of developing cancer",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "However, in the rest of Japan, the estimated thyroid doses are within a dose band of 1 to 10 mSv, the report said",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Outside the country, the estimated thyroid doses are less than 0.01 mSv, and are usually far below this very low level, it said",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Scientists looked at radiation doses to the thyroid, among other measures, because radioactive iodine-131 tends to accumulate in the thyroid, the most exposed organ in the body",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "After the Chernobyl accident in 1986, a higher incidence of thyroid cancer was found in people who were children at the time of the accident, previous studies have found",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

