{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- The Pacific Tsunami Warning Center canceled a tsunami warning less than an hour after it was issued Wednesday for Kermadec Island, Tonga and New Zealand",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "A tsunami was detected following a major earthquake nearby",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "A 1-meter-high tsunami washed ashore at Raoul Island, the largest and northernmost of the main Kermadec Islands, said Vinhlu Hsu, a geophysicist with the Pacific Tsunami Warning Center in Hawaii",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "It caused no damage, he said",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The tsunami formed after an earthquake with a preliminary magnitude of 7.6 shook the Kermadec Islands at 7:03 a.m. Thursday (3:03 p.m",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "ET Wednesday), according to the U.S. Geological Survey",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The quake was centered 163 kilometers (101 miles) east of Raoul Island, and 913 kilometers (567 miles) south of Nuku'alofa, Tonga, the survey said",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The depth was a relatively shallow 20 kilometers (12.4 miles)",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\"Sea-level readings confirm that a tsunami was generated,\" the center said",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "New Zealand's Ministry of Civil Defense and Emergency Management said it was keeping a marine threat warning in place throughout Thursday for waters off northern New Zealand",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Spokesman Vince Cholewa told CNN that boaters should not take to sea or operate in estuaries and people should stay off the beaches and coasts",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

