{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Cap-Haitien, Haiti (CNN) -- Haiti reported more cholera deaths Wednesday as chaos reigned in this country's second-largest city, and cases among people who had traveled from Haiti were reported in Florida and the Dominican Republic",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "At least six people were wounded in related violence in Haiti",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Photos: Cholera in Haiti\n\nThe cholera-infected woman who had recently traveled from Haiti to Florida was recovering, the Florida Department of Health said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Her case was identified through the state's disease surveillance system and sent to the Centers for Disease Control and Prevention in Atlanta, Georgia, where it was confirmed, the state health department said",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Florida, home to about 241,000 Haiti-born residents, has asked local health care providers to watch for people who become sick or show symptoms of cholera after returning from travel to Haiti",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"We are working with our health care partners to ensure appropriate care of this individual and prevent the spread of this disease within the community,\" said State Surgeon General Ana Viamonte Ros",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"We will continue to monitor the state for any future cases.",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The first confirmed case in the Dominican Republic was a 32-year-old Haitian construction worker who returned Friday from Haiti with symptoms of the illness, the health ministry said Tuesday night",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The man, who was vomiting and had diarrhea, was hospitalized in Higuey, near the eastern resort town of Punta Cana, said Health Minister Bautista Rojas Gomez",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The man was in stable condition, according to the newspaper El Nacional",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "According to data provided by the Caribbean countries, the Dominican Republic is the second-most popular Caribbean destination for American tourists, only behind Cancun, Mexico",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

