{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A 7.2-magnitude earthquake has struck south of the Mariana Islands, according to the U.S. Geological Survey",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The Mariana Islands -- an archipelago in the western Pacific Ocean -- are made up of two U.S. territories, Guam and the Commonwealth of the Northern Mariana Islands",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The islands sit about three-quarters of the way from Hawaii to the Philippines",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The Pacific Tsunami Warning Center did not issue a tsunami warning after the quake, which struck at 7:19 a.m. Saturday (5:19 p.m",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "ET Friday)",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "\"We wouldn't expect any kind of significant tsunami for this event,\" said the center's director, Charles McCreery, noting that the quake's magnitude was relatively low to provoke one",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "There were no immediate reports of casualties or damage, emergency management officials said",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The quake struck about 375 kilometers (233 miles) west-southwest of Hagatna, Guam, and 445 kilometers (276 miles) west-southwest of Rota, Northern Mariana Islands",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "It ran 4.7 kilometers (2.9 miles) deep",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "CNN's Dan Gilgoff and Talia Kayali contributed to this report",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

