        ],
        [
            {
                "number": 2,
                "text": "It's harvest time in Napa Valley, and it appears that the 6.0-magnitude earthquake that struck Northern California did not impact vineyards or the grapes on the vine, a local vintners' association said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The Sunday earthquake that sent more than 100 people to the hospital also sent wine barrels tumbling and wine bottles flying in the early morning hours",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Yet a majority of region's vineyards are open for visitors",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Some wineries suffered damage to their barrel storage areas, wine inventory and production equipment over the weekend, but \"there were no reports of winery employees being injured by the earthquake,\" according a statement by Napa Valley Vintners, an association of 500 area vintners",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Signorello Estate, which took to social media to announce the Napa winery would be closed Sunday, reopened Monday for business, an employee told CNN",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Napa's Etude Wines stayed closed another day on Monday to clean up damage from the earthquake, but announced on its website that its tasting room would reopen on Tuesday",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"Weather throughout the growing season has been ideal and vintners are expecting yet another excellent vintage, the third year in a row in the region,\" the association reported",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Vintners who have quake-damaged equipment or facilities can contact the association to find \"temporary tanks and other production equipment to help them get through the next few weeks.",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Most of the valley is operating normally, Napa City Manager Mike Parness said at a Sunday news conference",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "\"I've been getting a lot of calls from people from outside the area that were planning on coming here, (who) are worried about it for fear this is some kind of disaster area, which means they can't come here and enjoy the valley,\" he said",
