{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Port-au-Prince, Haiti (CNN) -- Another aftershock rocked Haiti on Friday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Buildings shook",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "People looked around to see what else might fall",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Then they returned to what they had been doing",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "At a park in the capital that has become a tent city, a group of kids resumed their soccer game",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Aftershocks have become a way of life in this devastated country along with so many other life-threatening challenges",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The aftershocks -- smaller earthquakes that follow a more powerful one -- \"will continue for months, if not years,\" the U.S. Geological Survey said",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "\"The frequency of events will diminish with time, but damaging earthquakes will remain a threat.",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The quake Friday morning had a magnitude of 4.4, the Geological Survey said",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "That makes it much less powerful than the 7.0-magnitude quake that struck 10 days ago, leaving widespread death and destruction in its wake",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "An earthquake on Wednesday was the strongest aftershock so far, with a magnitude of 5.9",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

