                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A strong earthquake with a magnitude of 6.8 struck off the coast of Japan on Sunday, the U.S. Geological Survey reported",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The earthquake hit 468 kilometers (302 miles) south-southwest of Tokyo at a depth of 348 kilometers, according to the USGS",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "There were no immediate reports of injuries or damage",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The Pacific Tsunami Warning Center did not issue a tsunami warning",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The USGS gave the quake a preliminary magnitude of 7.0 before downgrading it to 6.8",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Ohio looks into quakes' possible link to fracking\n\nJapan lies along the Pacific \"ring of fire,\" an area of high seismic and volcanic activity stretching from New Zealand in the South Pacific up through Japan, across to Alaska and down the west coasts of North and South America",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Last year, a devastating earthquake and tsunami hit northeastern Japan, leaving thousands of people dead or missing",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The March 11 earthquake triggered powerful tsunami waves and sparked a nuclear crisis",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

