{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "A 4.1 magnitude earthquake struck Friday night in west-central South Carolina, the U.S. Geological Survey reported",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake was the strongest to hit South Carolina since 2002, local emergency management officials said",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The quake was centered 7 miles (12 kilometers) west-northwest of Edgefield, which is about 25 miles north of Augusta, Georgia, and 60 miles southwest of Columbia, South Carolina",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The town of Edgefield has some 4,750 residents, according to the U.S. Census Bureau",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The USGS estimates the quake's depth was about 3 miles (4.6 kilometers)",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The same federal agency initially estimated a 4.4 magnitude quake",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "An emergency dispatcher in Edgefield said there were no reports of damage or injuries tied to the tremor",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Columbia County, Georgia, and the South Carolina Emergency Management Division also reported no damage or injuries",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Still, the quake was big enough to be felt as far away as metropolitan Atlanta some 160 miles west",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The shaking stirred up a lot of instant reactions online in an area recently battered by a powerful winter storm",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "But unlike the snow and ice that just fell, the tenor of the tremor banter appeared to be light",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

