        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "The death toll from the magnitude-7.1 earthquake in the central Philippines rose Saturday to 183, authorities said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The massive quake, which struck Tuesday, also destroyed more 8,600 homes in Quezon City, according to the National Disaster Risk Reduction and Management Council",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The bulk of the casualties were in Bohol province",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Bohol residents struggle to recover after quake\n\nIn an update issued Saturday, the council said 583 people were injured and 13 were missing",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The quake was centered about 620 kilometers (385 miles) south-southeast of Manila, near Catigbian, and its depth was 20 kilometers (12 miles), according to the U.S. Geological Survey",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The Philippines disaster council gave the quake a slightly higher rating: 7.2 magnitude",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Measuring the magnitude of earthquakes\n\nThe quake hit on a national holiday in the Philippines, at the beginning of the Muslim festival of Eid al-Adha",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Landslides were reported in some areas",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "More than 8,500 homes were destroyed and nearly 26,000 were damaged, officials reported",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The quake has affected nearly 3.5 million people across six provinces",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "More than 370,000 people were forced from their homes in the worst-affected Bohol province, the council said",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "DAVID, Panama (CNN) -- Dozens of families frightened by aftershocks slept outside overnight Wednesday after a magnitude 6.2 earthquake shook coastal Panama near the border with Costa Rica",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake was centered about 235 miles (380 km) west of Panama City, near the town of David, according to the U.S. Geological Survey ",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The temblor occurred at 1:11 a.m",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "ET and residents reported feeling three aftershocks",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "There were no immediate reports of casualties, but damage was reported in the cities of Paso Canoa, David and Puerto Armuelles",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The extent of the damage was not immediately known",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Many families opted to stay outside their homes, saying that they felt as if the earth were swallowing them and that trees and their houses were falling down",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "One resident, Carlos Estribi, said he picked up his children in his arms and ran to the public plaza in David, seeking protection since he felt like his house was collapsing",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Family members told CNN that patients at the Regional Hospital of David went outside and refused to go back in because aftershocks were still being felt",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Patients at the Materno Infantil Jose de Obaldia Hospital and the Regional Rafael Hernandez Hospital also fled their rooms",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Cyclists from Costa Rica, Colombia, the Dominican Republic and Germany, who were in David for a bicycle race, also had to leave their hotel rooms",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

