        ],
        [
            {
                "number": 2,
                "text": "Dolakha, Nepal (CNN)As snow layered the trail before him, Hari Chaudhary thought it was odd",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The veteran trekking guide had never seen snow on the trail in early October",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The popular 21-day Annapurna Circuit takes trekkers in a horseshoe-shaped route around a majestic segment of the Himalayas in Nepal",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "On the 10th day of the tour, Chaudhary and his clients, two young Israeli women, were descending from the highest point of the trail, Thorung La Pass, to the next destination, a walk that would normally take about seven hours",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Now, after more than 10 hours of heading downhill, the snow pelted",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The flurry fell heavier and faster, obstructing their vision",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "There was nowhere to stop or rest; they had to keep walking",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "\"You couldn't see the trail, there was snow everywhere, making it easy to get lost,\" said Chaudhary",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "\"It was all white, in the distance you could only see shadows of people walking.",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Some wandered off the trail",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "As the blizzard continued, their feet sunk into the snow pile",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

