{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Golfers preparing for The Barclays FedEx Cup playoff event at Plainfield Country Club in New Jersey found themselves not only battling the course, but also the effects of a 5.8 magnitude earthquake which struck Virginia on Tuesday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake forced the closure of a nuclear power plant and was felt from as far afield as Georgia and New England, while also causing many PGA Tour players to post their reactions on the social-networking site Twitter",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "American world number 15 Bubba Watson used his @bubbawatson account to tweet: \"This house we rented just shook!",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Watson's compatriot Jason Dufner, who finished tied for 5th at the recent PGA Championship, also tweeted his shock after feeling the tremors: \"Earthquake in Jersey",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": "?",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Or someone trying to give me a shake down??",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Virginia earthquake rattles the East Coast\n\nThe 2007 Masters champion Zach Johnson was clearly concerned by the quake, in which no major injuries were reported, and tweeted: \"Well",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Just went through my first earthquake",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Gotta believe it wasn't a big one here in NJ",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "But, it freaked me out",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "#kneesbuckled.",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Briton Justin Rose has been on the PGA Tour since 2003 and was on the driving range when he felt the quake",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

