{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Washington (CNN) -- Haitians being treated on a U.S. Navy hospital ship are requiring longer care than expected, forcing the U.S. and other international agencies to scramble for an alternative",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The solution involves plans for a 3,000- to 5,000-bed temporary hospital on land, for continued care, because the ship is reaching its treatment limit, according to Gen. Douglas Fraser, the senior officer in charge of military operations in South America",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The USNS Comfort, the Navy's hospital ship sent to assist in aid efforts, has performed more than 200 surgeries and treated more than 1,000 patients injured in the January 12 earthquake, and has been bolstering its medical staff to keep up with the demand",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"It's used up the clinical capacity before we reach the bed-space capacity,\" Fraser, commander of the U.S. Southern Command, said at a Pentagon briefing Thursday",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"The effort that we have ongoing right now for the discharge is looking to put together a facility where we have the ability to recover those patients -- and be able to provide them with that recovery space and time that they need,\" Fraser said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "He said the initial effort would be to make a temporary facility on land the Haitian government has identified, with the facility consisting of tents and cots and whatever other resources can be scrounged together",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Earlier this week the head of the U.S. military's aid relief in Haiti told reporters the military was assisting in getting together components of a large facility with 3,000 to 5,000 beds, to handle the health needs in Haiti",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Lt. Gen. P.K",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Keen said the U.S. military would provide medical equipment, but the United Nations is working with other aid organizations to staff it and contractors to build it",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "It's not clear where the hospital will be but military officials say it will be just outside of the capital, Port-au-Prince",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Some patients discharged from the ship to continue care at home have no home to recover in, according to witnesses",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

