{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Port-au-Prince, Haiti (CNN) -- Earthquake victims, writhing in pain and grasping at life, watched doctors and nurses walk away from a field hospital Friday night after a Belgian medical team evacuated the area, saying it was concerned about security",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The decision left CNN Chief Medical Correspondent Sanjay Gupta as the only doctor at the hospital to get the patients through the night",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "CNN initially reported, based on conversations with some of the doctors, that the United Nations ordered the Belgian First Aid and Support Team to evacuate",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "However, Belgian Chief Coordinator Geert Gijs, a doctor who was at the hospital with 60 Belgian medical personnel, said it was his decision to pull the team out for the night",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Gijs said he requested U.N. security personnel to staff the hospital overnight, but was told that peacekeepers would only be able to evacuate the team",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "He said it was a \"tough decision\" but that he accepted the U.N. offer to evacuate after a Canadian medical team, also at the hospital with Canadian security officers, left the site Friday afternoon",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The Belgian team returned Saturday morning",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Gijs said the United Nations has agreed to provide security for Saturday night",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The team has requested the Belgian government to send its own troops for the field hospital, which Gijs expects to arrive late Sunday",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Responding to the CNN report that Gupta was the only doctor left at the Port-au-Prince field hospital, U.N. spokesman Martin Nesirky said Saturday that the world body's mission in Haiti did not order any medical team to leave",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "If the team left, it was at the request of their own organization, he said",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

