{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A 6.3-magnitude earthquake ripped through Christchurch, New Zealand, on Tuesday afternoon, causing multiple fatalities as it toppled buildings onto buses, buckled streets and damaged cathedrals, authorities said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "New Zealand Police announced on the agency's website that a large-scale evacuation of the central city was under way",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "According to the news release, the earthquake killed an undetermined number of people at various locations around the city, including passengers on two buses crushed by buildings that had fallen on them",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "TVNZ reported that the 147-year-old Christchurch Cathedral's spire had toppled, Christchurch Hospital was being evacuated and the airport was closed",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Laura Campbell told CNN she was at work at the bottom of a six-story building when the earthquake struck",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "She described seeing \"windows blowing out, bricks falling down, people screaming, the whole nine yards.",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"It was bloody serious,\" said Campbell, who was trying to walk home",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "\"I'm worried about what I'm going to find down the road.",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The U.S. Geological Survey said the quake struck just before 1 p.m. Tuesday (7 p.m. Monday ET), and a 5.6-magnitude aftershock struck about 15 minutes later",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The U.S.G.S",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "recorded a second 5.5-magnitude aftershock shortly before 3 p.m. local time",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

