                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "CARL AZUZ, CNN STUDENT NEWS ANCHOR: Military action is underway in the skies over Libya, and the U.S. is one of several countries involved",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "It's our first story in the week's first edition of CNN Student News",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "First Up: Libya Civil War\n\nAZUZ: It's called \"Operation Odyssey Dawn,\" and the goal is to enforce a no-fly zone over Libya",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The United Nations Security Council voted for that no-fly zone late last week",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The coalition responsible for enforcing it is made up of forces from the U.S., Great Britain and France, among others",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "After the Security Council's vote, Libya's government declared a cease-fire in its fighting with rebel forces",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "And it invited representatives from other nations to come to Libya to make sure the cease-fire was real",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Coalition forces were convinced that Libyan leader Moammar Gadhafi was not following the rules of the cease-fire",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
