{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- An earthquake struck late Saturday off Papua New Guinea's eastern coast with a preliminary magnitude of 7.5, the U.S. Geological Survey said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake struck at 11:27 p.m. (9:27 a.m",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "ET) and occurred at a depth of 19 miles (32 km), the USGS said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "It was centered 47 miles (75 km) southwest of Panguna, Papua New Guinea",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "After the quake, the Pacific Tsunami Warning Center issued a tsunami warning for Papua New Guinea and the Solomon Islands, but then canceled it",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Saturday's incident is the latest in a series of seismic events in the region over the week",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "They began with magnitude-7.1 and magnitude-6.5 earthquakes on April 11, just to the northeast and southeast, respectively",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Since then, 45 earthquakes of magnitude-4.5 or greater have occurred nearby",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Earthquakes with magnitudes between 7.0 and 7.9 are classified by USGS as \"major,\" second only to \"great,\" which are 8.0 and up",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

