{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "A strong earthquake shook central Japan on Saturday night, injuring dozens of people and destroying homes in a well-known ski resort, authorities said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Reports differed on the intensity of the quake, centered in a remote mountainous area of Nagano prefecture",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The Japan Meteorological Agency reported it was magnitude 6.8; the U.S. Geological Survey (USGS) said it was magnitude 6.2",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "One of the hardest hit areas was the skiing village of Hakuba, where at least seven housing and storage structures collapsed",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Seven of the 39 people hurt in the quake suffered serious injuries, Nagano prefectural police said",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Japanese television stations carried images of landslides that had cut off roads and railroads, as well as flattened houses and warped highways",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "More than 300 rescue workers were deployed to search for people trapped in collapsed homes",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Authorities said the rescue operation was completed",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "No electric facilities, including nuclear power plants, were damaged, the Tokyo Electric Power Co. said via Twitter Saturday",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Aftershocks followed the main quake Saturday night, including one measured at magnitude 4.1, the Japan Meteorological Agency said",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ]
