{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A 6.8-magnitude earthquake struck Monday off the third-largest island in the Philippines, prompting the country to issue a tsunami alert for the coastlines near the epicenter",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake struck about 11:49 a.m. (10:49 p.m. Sunday ET) about 70 kilometers (44 miles) from the coastal city of Dumaguete on the Philippine island of Negros, the USGS said",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The Philippine Institute of Volcanology and Seismology issued a Level 2 tsunami alert for areas along the Tanon Strait between Negros and the neighboring island of Cebu",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "That's a notch below the highest tsunami alert of Level 3, which requires evacuation of the affected areas, a spokeswoman for the institute said",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "She said the institute was advising people to watch out for unusual waves and to stay away from the shoreline",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The alert was issued at 12:31 p.m. (11:31 p.m. Sunday ET), the spokeswoman said",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "No tsunami warning has been issued for the wider Pacific region and there is no tsunami threat to Hawaii, the Pacific Tsunami Warning Center said",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The earthquake occurred in the ocean at a depth of 46.6 kilometers (29 miles), according to the USGS",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "There were no initial reports of widespread damage",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "At the Circle Inn Hotel in the city of Bacolod, which is on Negros but not on the coast nearest the quake's epicenter, a receptionist said the quake lasted between three and five minutes",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "\"We felt the shaking,\" the receptionist said",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

