{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- The magnitude-8.8 earthquake that rocked the west coast of Chile last month was violent enough to move the city of Concepcion at least 10 feet to the west and the capital, Santiago, about 11 inches to the west-southwest, researchers said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake also shifted other parts of South America, as far apart as the Falkland Islands and Fortaleza, Brazil",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The results were reached via global positioning satellite measurements taken before and after the February 27 quake by teams from The Ohio State University, the University of Hawaii, the University of Memphis and the California Institute of Technology, as well as agencies across South America",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "NASA scientists have also credited the quake with shifting the Earth's axis enough to create shorter days",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The change is negligible, but still worth noting: Each day should be 1.26 microseconds shorter, according to preliminary calculations",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "A microsecond is one-millionth of a second",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "A large quake -- like the one that hit Chile's Maule region -- shifts massive amounts of rock and alters the distribution of mass on the planet",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "When that distribution changes, it changes the rate at which the planet rotates",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "And the rotation rate determines the length of a day",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "\"Any worldly event that involves the movement of mass affects the Earth's rotation,\" Benjamin Fong Chao, of NASA's Goddard Space Flight Center in Greenbelt, Maryland, said while explaining the phenomenon in 2005",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Despite the tragedy of the earthquake, which killed hundreds of Chileans, scientists see opportunities to gain valuable information in the aftermath",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

