{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Melamchi, Nepal (CNN)Even from high above, flying in an Indian Air Force helicopter, it is easy to see that the people of Melamchi, central Nepal, are happy to see us",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Residents in this remote village, about a 44km drive from Nepal's capital, Kathmandu, stand on the distinctive steeply terraced hillsides and wave furiously as the relief flight passes overhead",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The mission, a joint effort between Indian air crew and a Nepalese army medical team, is only the third operation of its kind to reach the village since Saturday's massive 7.8-magnitude quake, which left more than 5,000 people dead",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The aircraft is stuffed to capacity with tents, medicines and packages of tinned tuna, instant noodles and rice, all bundled haphazardly aboard the Mi-17 by soldiers at the air base in Kathmandu barely 15 minutes earlier",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Local official Upendra Tamang is there to greet the helicopter as it touches down on a field in front of the village medical clinic, and waiting soldiers swing into action to unload the delivery",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "He says people have been desperately awaiting the supplies",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "The situation in Melamchi and the surrounding villages is \"dire,\" he tells CNN through a translator",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "According to Nepal's National Emergency Operation Center, 1,376 people were killed in Sindhupalchok District, where Melamchi is located, when the earthquake hit",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Some 18,000 houses were destroyed and 100,000 people have been displaced in the surrounding area, says Tamang",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "\"Everyone is sleeping outside,\" he says",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "He has serious concerns about food supplies in the region, saying the piled boxes of rice and noodles aren't nearly enough to meet the needs of local people",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

