{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A powerful earthquake struck early Monday in western Iran, injuring at least 250 people in a region near the border with Iraq",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Local authorities said they fear the quake may have caused widespread destruction in rural areas",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The 6.2-magnitude earthquake hit at a depth of around 10 kilometers (6 miles) in an area 36 kilometers southeast of the Iranian city of Abdanan, the U.S. Geological Survey said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "It was followed by a series of aftershocks",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The quake injured at least 250 people in the province of Ilam, Iran's official news agency IRNA reported, citing local disaster management authorities",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "The tremors cut off water, electricity and phone lines in Abdanan",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "There were no immediate reports of any deaths",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Ilam Governor Majid Asghari told IRNA that authorities expected to find severe destruction in rural areas close to the epicenter, which was roughly 40 kilometers from the Iraqi border and not far from Iranian oil exploration and production facilities",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "IRNA reported that eight villages were particularly hard hit, with around half the homes in them destroyed",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Two weaker earthquakes, of magnitudes 4.8 and 5.0, had hit Ilam on Sunday, the USGS said",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "What to know about earthquakes\n\nMeasuring the magnitude of earthquakes\n\nCNN's Sara Mazloumsaki and Stefan Simons contributed to this report",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

