{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- It met the definition of a major one, but the magnitude-7.2 earthquake that struck Friday in southern Mexico's Guerrero state didn't land the kind of punch that it might have",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "\"There was no way not to feel it,\" Gustavo Lozano told CNN about the temblor, which struck at 9:27 a.m. (10:27 a.m",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "ET) and was centered 22 miles (36 kilometers) north-northwest of Tecpan",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "He was with his family at their home in Barra de Potosi, a fishing village nearly a three-hour drive northwest of Tecpan, when the earthquake hit",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"It was extremely strong.",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Afraid of a possible tsunami, and unaware that no advisory had been issued for one, he and his family drove to a shelter at the Ixtapa-Zihuatanejo International Airport, where dozens of other people also were gathering",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "En route, they noticed a few walls from older buildings had collapsed, but nothing worse",
