{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Since March 11, the six reactors at the Fukushima Daiichi nuclear power plant have been in various states of disrepair after being battered by a 9.0-magnitude earthquake and subsequent tsunami",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Here is the latest on the status of each reactor and what was being done to prevent further emissions of radioactive material",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Reactor No",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "1\n\nPressure and temperature levels at the No",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "1 reactor continue to fluctuate, though Hidehiko Nishiyama of Japan's nuclear and industrial safety agency told reporters Friday that the situation then appeared \"rather stable.",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "While conceding that \"controlling the temperature and pressure has been difficult,\" Nishiyama said there were indications that the pressure and temperature were both decreasing",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Authorities hope to begin injecting fresh water, rather than seawater as has been done, into the reactor's spent nuclear fuel pool",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "According to the Japan Atomic Industrial Forum, a nuclear industry group basing its data on official government and utility information, the No",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "1 unit's reactor core has been damaged, but its containment vessel was not",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "As of Friday, the reactor's cooling systems were still not operational",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "Still, the building was \"severely damaged\" by an earlier hydrogen explosion",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

