{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Port-au-Prince, Haiti (CNN)  -- Rescuers were still finding survivors trapped in the ruins of collapsed buildings in earthquake-ravaged Haiti on Wednesday, and relief officials said efforts to get aid into the hands of survivors were improving",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "A magnitude 5.9 aftershock rattled Port-au-Prince early Wednesday, the strongest since the original 7.0-magnitude quake struck January 12, the United States Geological Survey reported",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "Meanwhile, complaints about bottlenecks that have hindered the delivery of food, water and medicine to survivors persisted even as U.S. and U.N. officials said the effort has begun to make progress",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"There's big success in getting things into the port,\" said Steve Hollingworth, chief operating officer of CARE",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"The real challenge now is following through and having a series of successful distributions going on all over the country, and that's a challenge for a lot of reasons.",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Wednesday's aftershock was centered about 35 miles (60 kilometers) west-southwest of Port-au-Prince, and about 6.2 miles (10 kilometers) deep, according to the USGS",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Patients at a hospital near Haiti's airport in the capital Port-au-Prince immediately started praying as the ground shook like a ship rocking back and forth",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "They asked for forgiveness and protection, a nurse there said",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "An aftershock that size can pose significant danger in an area where buildings already are damaged -- and one nonprofit organization, Save the Children, said its staff \"heard already-weakened structures collapsing\" as a result of the aftershock",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Engineering team heads to check buildings\n\nHaiti's government put the confirmed death toll at more than 72,000 on Tuesday, with other estimates ranging as high as 200,000",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The confirmed toll already puts Haiti's quake among the 10 deadliest of the last century, according to USGS figures",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

