{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Tokyo (CNN) -- Workers at the Fukushima Daiichi nuclear power station returned to the plant Friday after a strong aftershock forced them to leave a day earlier, the plant's owner said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake forced crews at the plant to evacuate as it rattled northern Japan late Thursday night",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "They returned to the plant about eight and a half hours later, and no fresh damage to the facility had been reported Friday afternoon, the Tokyo Electric Power Company said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "Before the quake, engineers had been injecting non-flammable nitrogen into the No",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "1 reactor containment shell to counter a buildup of hydrogen in the chamber",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "That process continued while the plant was evacuated, and so did the pumping of fresh water into that reactor and units 2 and 3, said Hidehiko Nishiyama, a spokesman for the Nuclear and Industrial Safety Agency",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Hydrogen buildup is a symptom of overheated fuel rods in the cores of the reactors, which plant workers have been struggling to keep under control since the earthquake and tsunami",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "The nitrogen injections are aimed at displacing oxygen in the reactor shell, reducing the possibility of an explosion -- a chance Tokyo Electric called \"extremely low.",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "A hydrogen explosion blew the roof and upper walls off the No 1. reactor building two days after the quake, and another blast two days later blew apart the No",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "3 building",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "A suspected hydrogen explosion is believed to have damaged the No",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

