{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Mexico City (CNN) -- A powerful earthquake with a preliminary magnitude of 6.3 struck southern Mexico on Monday, the U.S. Geological Survey said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake's epicenter was about 17 miles (27 kilometers) from Ometepec, Guerrero",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "It was about 7.6 miles (12 kilometers) deep, the USGS said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "There were no immediate reports of damage or injuries",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Officials described the quake as an aftershock of the 7.4-magnitude temblor which struck in the same area on March 20, damaging hundreds of homes",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "There have been 280 aftershocks since that quake, Mexico's National Seismological Survey reported",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Residents felt Monday's quake in Mexico City, hundreds of miles from the epicenter",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "There were no initial reports of major damage in the capital, Mayor Marcelo Ebrard said on Twitter",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The USGS describes Mexico as one of the most seismically active areas of the world",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The country sees an average of seven earthquakes daily with a magnitude greater than 3.0, according to Mexico's National Seismological Service",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "CNN's Krupskaia Alis, Rafael Romo and Sean Morris contributed to this report",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

