{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "Mexico City (CNN) -- A powerful earthquake with a preliminary magnitude of 6.3 struck southern Mexico on Monday, the U.S. Geological Survey said",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The quake's epicenter was about 17 miles (27 kilometers) from Ometepec, Guerrero",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "It was about 7.6 miles (12 kilometers) deep, the USGS said",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "There were no immediate reports of damage or injuries",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Officials described the quake as an aftershock of the 7.4-magnitude temblor which struck in the same area on March 20, damaging hundreds of homes",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "There have been 280 aftershocks since that quake, Mexico's National Seismological Survey reported",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Residents felt Monday's quake in Mexico City, hundreds of miles from the epicenter",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "There were no initial reports of major damage in the capital, Mayor Marcelo Ebrard said on Twitter",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "The USGS describes Mexico as one of the most seismically active areas of the world",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "The country sees an average of seven earthquakes daily with a magnitude greater than 3.0, according to Mexico's National Seismological Service",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "CNN's Krupskaia Alis, Rafael Romo and Sean Morris contributed to this report",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "This one was big but it's not the Big One",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "An 8.2-magnitude earthquake struck off the coast of northern Chile Tuesday night, triggering small landslides, setting off a tsunami and killing at least five people",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "But geologists say an even larger quake in the region is lurking",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "\"This magnitude 8.2 is not the large earthquake that we were expecting in this area,\" said Mark Simons, a geophysicist at Caltech in Pasadena, California",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "\"We're expecting a potentially even larger earthquake.",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "It could be tomorrow",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "Or it could be 50 years",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "\"We do not know when it's going to occur,\" he said",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Here's why:\n\nChile sits on an arc of volcanos and fault lines circling the Pacific Ocean known as the \"Ring of Fire.",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "This area sees frequent earthquakes and volcanic eruptions",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "The country itself has seen no shortage of seismic activity in recent years",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

