{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- A strong 6.6-magnitude earthquake struck Sunday off the coast of Antarctica, prompting a warning that there was a \"small possibility\" it could trigger a tsunami",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "The tremor was centered in waters south of South America's southern tip, about 334 miles (539 kilometers) west of Coronation Island and 388 miles northeast of Palmer Station in Antarctica, the U.S. Geological Survey reported",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "It hit at 9:40 a.m. local time (8:40 a.m",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "ET) on Sunday, according to the federal agency, and had an estimated depth of 6.2 miles",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "Afterward, the Pacific Tsunami Warning Center released a statement saying that there appears to be no threat of \"destructive widespread tsunami\" because of the quake",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "But the agency did state \"there is a small possibility of a local or regional tsunami that could affect coasts located usually no more than a few hundred kilometers from the earthquake epicenter",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"Authorities in the region near the epicenter should be made aware of this possibility,\" the warning center added",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

