{
    "paragraphs": [
        [],
        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Confusion and then an uneasy calm",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "That's how residents up and down the East Coast described their reaction to the 5.8-magnitude earthquake that rattled millions of people Tuesday",
                "label": "sentence"
            },
            {
                "number": 5,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 6,
                "text": "The quake, which struck at 1:51 p.m., was shallow -- just 3.7 miles deep",
                "label": "sentence"
            },
            {
                "number": 7,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 8,
                "text": "The epicenter was about 40 miles northwest of Richmond, Virginia, the U.S. Geological Survey said",
                "label": "sentence"
            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "It sent tremors throughout the region, surprising people at least as far away as New York, Ohio and Georgia",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Sarah Merz said her co-worker in Camden, New Jersey, was the first one to notice the rumbling",
                "label": "sentence"
            },
            {
                "number": 13,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 14,
                "text": "\"She said, 'What is that",
                "label": "sentence"
            },
            {
                "number": 15,
                "text": "?",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 16,
                "text": "Is it a train?",
                "label": "sentence"
            },
            {
                "number": 17,
                "text": "'",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 18,
                "text": "Everyone kind of started looking at each other",
                "label": "sentence"
            },
            {
                "number": 19,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 20,
                "text": "Everyone's eyes just kind of widened, and we all just ran to the front door.",
                "label": "sentence"
            },
            {
                "number": 21,
                "text": "\"",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 22,
                "text": "People stood stunned outside for a few minutes, she said",
                "label": "sentence"
            },
            {
                "number": 23,
                "text": ".",
                "label": "no-unit"
            }
        ]
    ]
}

