        [
            {
                "number": 1,
                "text": "Article",
                "label": "title"
            }
        ],
        [
            {
                "number": 2,
                "text": "(CNN) -- Cricket officials plan to commemorate the victims of the New Zealand earthquake when the country's national team plays neighboring Australia at the World Cup in India on Friday",
                "label": "sentence"
            },
            {
                "number": 3,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 4,
                "text": "Emergency workers are searching for survivors after at least 65 people were killed in a 6.3-magnitude quake in the southern hemisphere nation's second-biggest city Christchurch on Tuesday",
