            },
            {
                "number": 9,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 10,
                "text": "The USGS pinpointed the quake between the towns of Virgil and Sycamore, Illinois",
                "label": "sentence"
            },
            {
                "number": 11,
                "text": ".",
                "label": "no-unit"
            }
        ],
        [
            {
                "number": 12,
                "text": "Millions of people felt the temblor, with reports coming in to the USGS from Georgia, Tennessee, Kentucky, Ohio, Indiana, Michigan, Iowa and Wisconsin, as well as Illinois",
